(26, 'Term', 51, 'Adelaide', 'A clean window shows you a clean world - clean it from $150', 'What we see when watching others depends on the purity of the window through which we look. We can clean up to 3 stories’ windows by using a water fed pole system in Adelaide.', 'Best Window cleaners in Adelaide, Post Construction Window Cleaning Adelaide, Flyscreen Cleaning, Security Screen Cleaning, After Renovation Window Cleaning Adelaide, Best After Builders Window cleaning, Higher Window Cleaners Adelaide, Skylight Cleaners in Adelaide, Solar Panel Cleaners in Adelaide, Glass Balustrade Cleaning Adelaide, First Story Window Cleaners Adelaide, Double Story Window Cleaners Adelaide, Third Story Window Cleaners Adelaide, Best High Rise Window cleaners Adelaide, Window Washing in Adelaide, Regular Solar Panel Cleaning Adelaide, Solar Panel Cleaning Adelaide, Best professional window cleaners in Adelaide', NULL, NULL, '2022-05-10 18:50:40', '2022-05-24 14:03:39'),
(27, 'Term', 53, 'Adelaide', 'Clean solar panels increase up to 30% output - starts from $150', 'Our solar panel cleaning process begins with checking the condition of the wiring, system brackets and a visual check of solar panels, inverter and silicone connections. Moreover, we are 100% insured.', 'Higher Window Cleaners Adelaide, Skylight Cleaners in Adelaide, Solar Panel Cleaners in Adelaide, Glass Balustrade Cleaning, First Story Window Cleaners Adelaide, Double Story Window Cleaners Adelaide, Third Story Window Cleaners Adelaide, Best High Rise Window cleaners, Window Washing in Adelaide, Regular Solar Panel Cleaning Adelaide, Solar Panel Cleaning Adelaide, Best professional window cleaners in Adelaide', NULL, NULL, '2022-05-10 18:52:59', '2022-05-10 18:52:59'),
(28, 'Term', 55, 'Adelaide', 'Tile and grout cleaning Adelaide - hire a pro from $280 only', 'We clean your tile and grout using a high-pressure washer steam cleaner, attached with a vacuum, leaving no mess on the floors and bringing the best result in one go. That\'s why we are pro.', 'Best Floor cleaners Adelaide, Tiles cleaning Adelaide, Grout cleaning Adelaide, Tile and grout cleaning Adelaide, Bathroom cleaning Adelaide, Shower Screen Cleaning Adelaide, Best tile and grout cleaning company Adelaide, Kitchen tiles cleaning Adelaide, Interior tile cleaning Adelaide, Exterior tile cleaning Adelaide, Floor cleaning Adelaide', NULL, NULL, '2022-05-11 10:50:57', '2022-05-11 10:51:15'),
(29, 'Term', 38, 'Adelaide', 'Spring cleaning or once off cleaning Adelaide - from $180 only', 'Who doesn\'t want spare time to spend with their beloved family in a clean and healthy place? In our once-off, pre-inspection, or spring cleaning there is no limit to what we do.', 'Spring Cleaning Adelaide, Once off cleaning Adelaide, Pre-inspection cleaning Adelaide, House deep cleaning Adelaide, Hourly cleaning Adelaide, Spring cleaning checklist Adelaide, House deep cleaning checklist Adelaide, Pre-inspection cleaning checklist Adelaide, House spring cleaning, Best spring cleaning service provider in Adelaide, Spring cleaning services Adelaide', NULL, NULL, '2022-05-11 18:26:16', '2022-05-11 18:26:16'),
