(5, 34, 7, 'Bullets Vertical', 'Know before booking our end of lease cleaning services:', 'know-before-booking-our-end-of-lease-cleaning-services', NULL, '136', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 18, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-02-11 18:45:02'),
(7, 34, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 4, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-02-11 19:25:57'),
(8, 34, 7, 'Side by Side Bullets', 'End of lease cleaning service inclusion:', 'end-of-lease-cleaning-service-inclusion', NULL, NULL, NULL, '<p class=\"MsoNoSpacing\" style=\"text-align:justify;text-justify:inter-ideograph\"><span lang=\"EN-IN\" style=\"font-size:13.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#111111;letter-spacing:-.15pt;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm\">A general end-of-lease cleaning\r\nrequires the property to be empty. If there are any items in the cupboards, on\r\nthe floors, benchtop, etc., we will clean around those. We will not be\r\nresponsible for moving any items for the space to be cleaned.<o:p></o:p></span></p>', 'For following service we charge extra in our end of lease cleaning services', 'Adelaide', 7, '#ffffff', NULL, '2021-10-22 11:08:23', '2022-02-19 18:42:26'),
(24, 34, 7, 'Term Title', 'End of Lease <span>Cleaning</span>', 'end-of-lease-spancleaningspan', NULL, '88', 139, '<p><span style=\"font-size: 1rem;\"><span style=\"font-size: 13.5pt; font-family: lucida, &quot;serif&quot;;\" lang=\"EN-AU\">We are<strong> OZ CLEANERS!!!</strong></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\">Leaving home? And worried about getting back your bond 100%? Don’t worry, we got you, we are professionals and very reasonable.</span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\"><br></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\">Doesn\'t matter how picky a real estate agent you got, with our moving out cleaning we provide a 100% bond back guarantee. Our professional teams are ready to help, 7 days a week.</span></font></p><p><br></p>', NULL, 'Adelaide', 0, '#ffffff', 'Yes', '2022-01-19 18:19:32', '2022-05-10 18:22:12'),
(26, 34, 7, 'Why Choose Us', 'Why choose us', 'why-choose-us', NULL, '50', NULL, '<p>Services we provide</p>', NULL, 'Adelaide', 3, '#f5f5f5', 'Yes', '2022-01-23 10:25:14', '2022-02-11 18:45:02'),
(27, 34, 7, 'Right Image Content', 'Bond Cleaning <span>In Adelaide</span>', 'bond-cleaning-spanin-adelaide', 'We work relentlessly to get your bond back and provide ultimate cleaning.', '103', NULL, '<p>As an end of lease cleaning service provider in Adelaide, we are not the best, but still, our competitors hate us.\r\n\r\nNo, wrong if you think because we charge the least money to provide any end of lease cleaning service.&nbsp;</p><p><br></p><p>We must say we are not the cheapest but affordable than many other competitors in the market.\r\n\r\nOther bond cleanings or exit cleaning service providers hate us because our clients love us.&nbsp;</p><p><br></p><p>They do marketing for us to their friends and families. They advise us about how to make our service better and so on.</p>', NULL, 'Adelaide', 1, '#ffffff', 'Yes', '2022-01-23 20:44:47', '2022-02-11 18:45:02'),
(28, 34, 7, 'Left Image Content', 'Bond back guaranteed', 'bond-back-guaranteed', NULL, '108', NULL, '<p>Our thorough cleaning will ensure that the property is good enough for you to get 100% bond money back as a tenant.</p><p><br></p><p>Agents and landlords to the other side will have no problem getting new bonds with a clean property.<br></p><p><br></p><p>We have a full range of cleaning equipment and experienced teams to carry out a comprehensive end-of-lease cleaning for you. We have options to choose from our tailored packages or customize one that suits your needs.</p>', NULL, 'Adelaide', 6, '#000000', 'Yes', '2022-01-23 21:01:21', '2022-02-11 18:45:02'),
(29, 34, 7, 'Left Image Content Without Title', 'Exit Cleaning is an <span>Art</span>', 'exit-cleaning-is-an-spanartspan', NULL, '107', NULL, '<p>To beat the competition, now most cleaning companies provide a 100% bond back guarantee with their bond cleaning services. No doubt everyone\'s finger crosses for no issues after leaving the property.&nbsp;</p><p><strong><br></strong></p><p><strong>However, bad situations come, mistakes happen, and it\'s normal, correct?</strong></p><p>It happens with us as well. We also need to go back sometimes to a job a second time when your agent finds any issues with our cleaning services.</p>', NULL, 'Adelaide', 2, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-02-11 18:45:02'),
(42, 34, 7, 'Right Image Content', 'We respect our clients', 'we-respect-our-clients', NULL, '104', NULL, '<p>We stand out from our competitors by providing the best after-sales service. We even hire other professionals for our clients, if there is something you need and we don\'t do.</p><p><br></p><p>For example, gardener, painter, handymen, etc. If you book with us and let us know you need those services then we will provide you our contact list for those jobs or contact for you with them.</p><p><br></p><p>We make moving out a less stressful affair for you with real estate agents by our professional exit cleaning services, and that\'s our promise.</p>', NULL, 'Adelaide', 5, '#ffffff', 'Yes', '2022-01-30 20:12:49', '2022-02-11 18:45:02'),
(44, 34, 7, 'Right Image Content', 'To provide the following service we charge extra in our end of lease cleaning service Adelaide:', 'to-provide-the-following-service-we-charge-extra-in-our-end-of-lease-cleaning-service-adelaide', NULL, '127', NULL, '<p><strong>Carpet steam cleaning:</strong></p><p>It is considered an extra service since every property doesn’t have carpets. In our regular end of lease cleaning service package, we use a carpet shampooing machine if carpet cleaning is required.</p><p><br></p><p>However, if you want carpet steam cleaning, please book it separately or discuss it with our friendly team.</p>', NULL, 'Adelaide', 9, '#ffffff', 'Yes', '2022-01-31 20:17:01', '2022-02-11 18:45:02'),
(45, 34, 7, 'Right Image Content Without Title', 'Exterior window cleaning:', 'exterior-window-cleaning', NULL, '129', NULL, '<p><strong>Exterior window cleaning:</strong></p><p>We can’t predict how big the windows are or how many panes are there without visiting the property. We assume a price based on the property details you provided in our system.</p><p><br></p><p>However, the price may vary based on the number of panes, high windows, jobs difficulties, etc. There is a higher chance of damage when we open and re-install fly screens after cleaning.</p><p><br></p><p>That’s why we ask our clients to keep the fly-screens removed before we start and re-install when we finish. Or else, we will avoid those glasses.</p>', NULL, 'Adelaide', 11, '#ffffff', 'Yes', '2022-01-31 20:20:33', '2022-02-11 18:45:02'),
(46, 34, 7, 'Left Image Content Without Title', 'Spot Cleaning from walls:', 'spot-cleaning-from-walls', NULL, '126', NULL, '<p><strong>Spot Cleaning from walls:</strong><br></p><p>Most people think it should be on the general cleaning list, but we know this can be the hardest part of the job. The price we quote over the phone or in our system is just an approximate idea.</p><p><br></p><p>Based on the condition of the walls, we will decide the actual amount after discussing with you when our team is on-site.</p><p><strong><br></strong></p><p><strong>Garage cleaning:</strong></p><p>In garage cleaning, we sweep and vacuum the floor, remove the cobwebs, dust the walls, and clean the skirting boards only.</p>', NULL, 'Adelaide', 12, '#ffffff', 'Yes', '2022-01-31 20:30:15', '2022-02-11 18:45:02'),
(47, 34, 7, 'Right Image Content Without Title', 'Blinds cleaning:', 'blinds-cleaning', NULL, '124', NULL, '<p><strong>Blinds cleaning:\r\n</strong></p><p>There are different types of blinds, and some seem very easy to clean but take too much time that you can’t even imagine. That’s why we charge extra for general blind cleaning. Please note, we don’t clean curtains at all, but you can go to this website for a quote.</p><p><strong><br></strong></p><p><strong>Balcony cleaning:</strong></p><p>We do not scrub the balcony but sweep, vacuum, and mop. Also, clean the outside glasses of the sliding doors when the balcony is considered an extra service.</p>', NULL, 'Adelaide', 13, '#ffffff', 'Yes', '2022-01-31 20:34:40', '2022-02-11 18:45:02'),
(49, 34, 7, 'Left Image Content Without Title', 'Air-conditioner vent cleaning:', 'air-conditioner-vent-cleaning', NULL, '128', NULL, '<p><strong>Air-conditioner vent cleaning:</strong><br></p><p>We can quote for this only when our team is on-site, and they can do it since it can be a critical job. The price depends based on the difficulties and cleaning requirements upon discussion.</p><p><br></p><p><strong>Exterior house cleaning:</strong></p><p>This includes sweeping the outside area, removing cobwebs, and washing the whole house by hose pipe. No pressure washing is included in this service. If you need to remove any oil stains or something like that, please discuss it with our friendly team.<br></p>', NULL, 'Adelaide', 14, '#ffffff', 'Yes', '2022-01-31 20:50:03', '2022-02-11 18:45:02'),
(50, 34, 7, 'Right Image Content', 'Things we don\'t in our regular end of lease cleaning service Adelaide:', 'things-we-dont-in-our-regular-end-of-lease-cleaning-service-adelaide', NULL, '133', NULL, '<p></p><ul><li>Cleaning ceilings or anything more than 3 meters high, for example, windows if was not discussed before.</li><li>Lifting heavy items and furniture to clean underneath or inaccessible areas or corners by hand, mop, or vacuum.</li><li>Cleaning inside appliances if not booked as an extra service like fridge, washing machine, etc.</li></ul><p></p>', NULL, 'Adelaide', 16, '#ffffff', 'Yes', '2022-01-31 21:00:28', '2022-02-11 18:45:02'),
(51, 34, 7, 'Left Image Content', 'End of lease cleaning - bond back guarantee:', 'end-of-lease-cleaning---bond-back-guarantee', NULL, '134', NULL, '<ul><li>Bond back guarantee means we return for free to rectify any issues your agent has from our checklist.</li><li>To claim a guarantee, you need to email us within 7 calendar days with the exit report and the agent\'s details. Any complaint will only be accepted in writing by email with photos.</li><li>In the case of any cleaning complaint, we require either the customer or the property manager to check the work. While our cleaners are still present on the property, please make sure complaints have been fixed to the standard you want.</li><li>With our unstoppable desire to grow the business, we can assure you, for one thing, you will never regret choosing us.</li></ul>', NULL, 'Adelaide', 17, '#ffffff', 'Yes', '2022-02-01 16:22:54', '2022-02-11 18:45:02'),
(223, 34, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 8, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-02-11 19:26:10'),
(224, 34, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 15, '#ffffff', NULL, '2022-02-11 18:42:46', '2022-02-11 19:26:26'),
(266, 36, 7, 'Bullets Vertical', 'Know before booking our carpet steam cleaning & upholstery services:', 'know-before-booking-our-carpet-steam-cleaning-and-upholstery-services', NULL, '151', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 19, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-02-20 19:34:47'),
(267, 36, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 4, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-02-20 19:34:47'),
(269, 36, 7, 'Term Title', 'Carpet Steam <span>Cleaning</span>', 'carpet-steam-cleaning', NULL, '85', 147, '<p><span style=\"font-size: 1rem;\"><span lang=\"EN-AU\" style=\"font-size: 13.5pt; font-family: lucida, &quot;serif&quot;;\">We are<strong> OZ CLEANERS!!!</strong></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\">There are three different kinds of carpet cleaning machines, steam cleaning, shampooing &amp; dry cleaning. Carpet steam cleaning is the best, not the cheapest but affordable with us in Adelaide.</span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\"><br></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\">If your concern is the budget then we can provide carpet shampooing too and this will give you nearly the same results as the steam cleaner does because our technicians really know how to do that.</span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><strong style=\"font-size: 18px; font-family: lucida, serif;\"><br></strong></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><strong style=\"font-size: 18px; font-family: lucida, serif;\">Is not that awesome !!!</strong><br></p>', NULL, 'Adelaide', 0, '#ffffff', 'Yes', '2022-01-19 18:19:32', '2022-02-20 19:34:47'),
(270, 36, 7, 'Why Choose Us', 'Why choose us', 'why-choose-us', NULL, '50', NULL, '<p>Services we provide</p>', NULL, 'Adelaide', 10, '#f5f5f5', 'Yes', '2022-01-23 10:25:14', '2022-02-20 19:34:47'),
(271, 36, 7, 'Right Image Content', 'Carpet Steam Cleaning <span>In Adelaide</span>', 'carpet-steam-cleaning-spanin-adelaidespan', 'Upholstery and Carpet steam cleaning – know different types to choose the best', '156', NULL, '<p>If you have carpet, you must need professional carpet cleaning services. If you don\'t have carpet, you still need to hire professionals sometimes to clean your upholstery like Couch, Sofa, Arm Chair, Mattress, car seats, etc.</p><p><br></p><p>Most of the people, almost everyone, when looking for a carpet cleaning service, is thinking, saying, or writing ‘carpet steam cleaning’ in Google not ‘carpet cleaning’. Confused, what is the difference between carpet cleaning and carpet steam cleaning? There is a very big difference between these two.</p><p><br></p><p>Three kinds of carpet cleaning machines are available in the market and the cleaning process is also different; as well as the end results too.</p>', NULL, 'Adelaide', 1, '#ffffff', 'Yes', '2022-01-23 20:44:47', '2022-05-10 18:27:41'),
(272, 36, 7, 'Left Image Content Without Title', 'Bond back guaranteed', 'bond-back-guaranteed', NULL, '157', NULL, '<p>The solution helps break down the dirt within the carpet, make it easier to vacuum, and remove any stains easily with the machine.</p><p><br></p><p>In the final stage, use the cotton pad with a rotary machine-like floor polisher to wipe all dirt and stains from the carpet. The cotton pads spin on the carpet to remove stains and soil attached to the carpet fibers.</p><p><br></p><p>The most positive side of carpet dry cleaning is you can walk on it again within just an hour or even less!</p>', NULL, 'Adelaide', 6, '#000000', 'Yes', '2022-01-23 21:01:21', '2022-02-20 19:34:47'),
(273, 36, 7, 'Left Image Content', '1. Carpet shampooing machine', '1-carpet-shampooing-machine', NULL, '163', NULL, '<p>Thoroughly vacuum the carpet first and then spray chemicals on it. Wait for a minimum of 15 minutes. Use a mixture of the same chemicals and hot water inside the machine, and then start your carpet shampooing. Spray and suck together slowly and gently, like a vacuum cleaner.</p><p><br></p><p>For a better result, use clean hot water again in the machine and repeat the process. For the complete carpet shampooing process in detail, you can visit https://www.wikihow.com/Shampoo-a-Carpet.</p><p><br></p><p>Now, know the reality of your carpet cleaners, not in general but happens very frequently. They will vacuum the carpet first before using the carpet shampooing machine, no doubt.</p>', NULL, 'Adelaide', 2, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-02-20 19:34:47'),
(274, 36, 7, 'Right Image Content', '2. Carpet dry cleaning machine', '2-carpet-dry-cleaning-machine', NULL, '165', NULL, '<p>Have you got any experience like walking in a park and suddenly a bird poop on your dress! What to do now?</p><p><br></p><p>If you have any tissue paper handy, you will wipe it away. If the water is available, use a bit with the tissue to make your dress clean, correct?</p><p><br></p><p>Carpet dry cleaning is the same as cleaning your dress. The initial process for carpet dry cleaning is, spraying a chemical solution on your carpet first, and then waiting for 15-20 minutes before using the machine.</p><p><br></p>', NULL, 'Adelaide', 5, '#ffffff', 'Yes', '2022-01-30 20:12:49', '2022-02-20 19:34:47'),
(275, 36, 7, 'Right Image Content', 'To provide the following service we charge extra in our regular carpet steam cleaning service in Adelaide:', 'to-provide-the-following-service-we-charge-extra-in-our-regular-carpet-steam-cleaning-service-in-adelaide', NULL, '162', NULL, '<p><strong>Rugs cleaning:</strong></p><p>We charge extra for rug cleaning apart from the regular carpet cleaning since the process is different than the normal carpet cleaning.</p><p><br></p><p>Yet, sometimes we bring the rugs with us for a deep cleaning which requires a specific set-up for the best outcome upon discussion with you.</p><p><br></p><p><strong>Mattress cleaning (Upholstery cleaning):<br></strong></p><p>The cleaning process of the mattress is different than any other upholstery cleaning. Sometimes we require bringing the mattress in our place to give it a new look again if possible.<br></p>', NULL, 'Adelaide', 13, '#ffffff', 'Yes', '2022-01-31 20:17:01', '2022-02-20 19:34:47'),
(276, 36, 7, 'Left Image Content Without Title', 'Carpet Steam Cleaning', 'carpet-steam-cleaning', NULL, '159', NULL, '<p>But the difference is, when you are spraying the chemical, this machine puts a tolerable pressure on the carpet. The process is the same as high-pressure cleaning of your driveway. After that, vacuum the carpets at a great suction power as well.</p><p><br></p><p>Now you decide which one can give you the best result while considering cleaning your carpets, not pretending to clean. Of course, carpet steam cleaning machine, right?</p><p><br></p><p>That is the best way to clean your carpet while the cleaner can use the carpet steam cleaning machine properly then he can make your carpet like new again.</p><p><br></p><p>It does not matter how dirty your carpet was. For a complete understanding of the carpet steam cleaning process, please <a href=\"https://www.wikihow.com/Steam-Clean-Carpet\">visit here</a>.</p>', NULL, 'Adelaide', 9, '#ffffff', 'Yes', '2022-01-31 20:20:33', '2022-05-10 18:35:02'),
(277, 36, 7, 'Left Image Content Without Title', 'Upholstery cleaning', 'upholstery-cleaning', NULL, '158', NULL, '<p><strong><br></strong></p><p><strong>Couch cleaning (upholstery cleaning):</strong></p><p>It is always better to clean your couch regularly for a long lifespan and odor-free clean look. The cleaning charge for the couch depends on the number of seats, dirtiness, etc.</p><p><br></p><p><strong>Armchair cleaning (upholstery cleaning):</strong></p><p>This one is also like the couch, but we kept it separate because of the extra effort armchair cleaning requires than a couch or sofa cleaning.</p><p><br></p>', NULL, 'Adelaide', 14, '#ffffff', 'Yes', '2022-01-31 20:30:15', '2022-02-20 19:34:47'),
(278, 36, 7, 'Right Image Content Without Title', 'Car seats cleaning (upholstery cleaning)', 'car-seats-cleaning-upholstery-cleaning', NULL, '161', NULL, '<p><span style=\"font-weight: bolder;\"><br></span></p><p><span style=\"font-weight: bolder;\">Dining chair cleaning (upholstery cleaning):</span></p><p>Sometimes you need to clean your dining chair while it has a cushion on it. Not everyone can give you the solution, but we can. Clean your dining chare to remove all darts and food marks from it.</p><p><br></p><p><strong>Car seats cleaning (upholstery cleaning):</strong></p><p>Since we do almost all kinds of upholstery cleaning, it is an easy job for us. You do not need to manage time to go to the car wash to give the car and bring it back after cleaning. Renting uber is an extra cost for you as well, no doubt.</p><p><br></p>', NULL, 'Adelaide', 15, '#ffffff', 'Yes', '2022-01-31 20:34:40', '2022-02-20 19:34:47'),
(279, 36, 7, 'Right Image Content', '3. Carpet steam cleaning machine', '3-carpet-steam-cleaning-machine', NULL, '164', NULL, '<p>Let us continue walking to the park imagination. You cleaned your dress with water and tissue paper, and no marks were present.</p><p><br></p><p>Will you wear it again without washing it in hot water after soaking it with washing powder? No, because you know it seems clean, but it is still dirty correct? So, you will give it a proper wash.</p><p><br></p><p>Carpet steam cleaning is the same. The initial process is the same as other machines. First spray chemical on the carpet, wait for 15-20 minutes, then start the carpet steam cleaning machine to suck the chemical while spraying a mixture of chemicals and hot water at the same time.</p>', NULL, 'Adelaide', 8, '#ffffff', 'Yes', '2022-01-31 20:38:41', '2022-02-20 19:34:47'),
(281, 36, 7, 'Right Image Content', 'Things we don\'t in our regular carpet steam cleaning service in Adelaide:', 'things-we-dont-in-our-regular-carpet-steam-cleaning-service-in-adelaide', NULL, '133', NULL, '<ul><li>Lifting heavy items and furniture to clean underneath.</li><li>Areas not accessible - such as under the bed or couch.<br></li></ul>', NULL, 'Adelaide', 17, '#ffffff', 'Yes', '2022-01-31 21:00:28', '2022-02-20 19:34:47'),
(282, 36, 7, 'Left Image Content', 'Upholstery and Carpet steam cleaning - satisfaction guarantee', 'upholstery-and-carpet-steam-cleaning---satisfaction-guarantee', NULL, '149', NULL, '<p></p><ul><li>Our guarantee means we will return free of charge to rectify any issues the agent (for end-of-lease cleaning) or you have with our carpet steam cleaning service.</li><li>To claim a guarantee, you need to email us within 7 calendar days with the exit report and the agent\'s details. Any complaint will only be accepted in writing by email with photos.</li><li>No exceptions to the 7 calendar days condition unless discussed in writing by email before the job is done. It may take up to 3 working days days to rectify the issues raised by your agent.</li><li>In the case of any cleaning complaint, we require either the customer or the property manager to check the work. While our cleaners are still present on the property, please make sure complaints have been fixed to the standard you want.</li><li>We have an unstoppable desire to grow our business in the cleaning industries in Adelaide, South Australia. So we assure you will never regret it if you buy our carpet steam cleaning services among many other competitors out there.</li></ul><p></p>', NULL, 'Adelaide', 18, '#ffffff', 'Yes', '2022-02-01 16:22:54', '2022-02-20 19:34:47'),
(283, 36, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 12, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-02-20 19:34:47'),
(285, 36, 7, 'Right Image Content Without Title', 'Carpet Steam Cleaning', 'carpet-steam-cleaning', NULL, '160', NULL, '<p>But generally, they do not use the special nozzle with the vacuum to clean the corners properly, and those areas remain dirty because the carpet cleaning machine cannot reach those areas.</p><p><br></p><p>After that, they will start the carpet cleaner, spray and suck the chemical mixture together, no pre-spray. Forget about cleaning the carpet again with water.</p><p><br></p><p>Then if you are present there, they will show you how dirty your carpet was while cleaning the dirty water tank. Honestly, almost the same result can come too by using a wet and dry vacuum cleaner.</p><p><br></p><p>But the result could be far better if he followed the proper carpet shampooing process.<br></p>', NULL, 'Adelaide', 3, '#ffffff', NULL, '2022-02-19 18:24:51', '2022-02-20 19:34:47'),
(286, 36, 7, 'Right Image Content', 'Carpet steam cleaning service frequency', 'carpet-steam-cleaning-service-frequency', NULL, '127', NULL, '<p>Most professionals will recommend steam cleaning your carpet quarterly apart from routine cleaning. That is more important when you have pets, children, and family members who are allergic to environmental conditions.</p><p><br></p><p>The presence of mold and mildews poses a big problem for such homes. Our professional carpet steam cleaning does everything to minimize harmful effects.</p><p><br></p><p><strong>Our powerful carpet cleaning machine and the efficient team helps remove dust, dirt, and allergens from your carpet:</strong></p><p><strong><br></strong></p><p><span style=\"white-space:pre\">	</span>We help extend your carpet’s lifespan and make your home more inviting</p><p><span style=\"white-space:pre\">	</span>We use non-toxic and eco-friendly cleaning agents for carpet cleaning</p><p><span style=\"white-space:pre\">	</span>We can remove all types of stains from your carpet if required</p><p><br></p>', NULL, 'Adelaide', 11, '#ffffff', NULL, '2022-02-19 18:53:13', '2022-02-20 19:34:47'),
(287, 36, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 7, '#ffffff', NULL, '2022-02-20 19:33:47', '2022-02-20 19:34:47'),
(288, 36, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 16, '#ffffff', NULL, '2022-02-20 19:34:38', '2022-02-20 19:34:47'),
(289, 51, 7, 'Bullets Vertical', 'Know before booking our carpet steam cleaning & upholstery services:', 'know-before-booking-our-carpet-steam-cleaning-and-upholstery-services', NULL, '168', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 20, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-02-20 22:06:47'),
(290, 51, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 5, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-02-20 22:06:47'),
(291, 51, 7, 'Term Title', 'Window Cleaning', 'window-cleaning', NULL, '166', 167, '<p><span style=\"font-size: 1rem;\"><span lang=\"EN-AU\" style=\"font-size: 13.5pt; font-family: lucida, &quot;serif&quot;;\">We are<strong> OZ CLEANERS!!!</strong></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\">What we see when watching others depends on the purity of the window through which we look. We can clean up to 3 story’s windows by using water fed pole system in Adelaide.</span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\"><br></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\">Cleaning is all about detailing and we clean your windows in such a way that you will think your windows are open. We never compromise with quality and our client’s satisfaction, since we consider our clients as our assets.</span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><strong style=\"font-size: 18px; font-family: lucida, serif;\"><br></strong></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><strong style=\"font-size: 18px; font-family: lucida, serif;\">Is not that awesome !!!</strong><br></p>', NULL, 'Adelaide', 0, '#ffffff', 'Yes', '2022-01-19 18:19:32', '2022-02-20 22:06:47'),
(292, 51, 7, 'Why Choose Us', 'Why choose us', 'why-choose-us', NULL, '50', NULL, '<p>Services we provide</p>', NULL, 'Adelaide', 10, '#f5f5f5', 'Yes', '2022-01-23 10:25:14', '2022-02-20 22:06:47'),
(293, 51, 7, 'Right Image Content', 'Window Cleaning <span>In Adelaide</span>', 'window-cleaning-spanin-adelaidespan', 'Clean windows give a fresh look to your eyes', '176', NULL, '<p>A young couple moves into a new neighborhood. The next morning while they were eating breakfast, the young woman sees her neighbor hanging the wash outside.</p><p><br></p><p>“That laundry is not very clean,” she said. “She doesn’t know how to wash correctly. Perhaps she needs better laundry soap.”</p><p>Her husband looked on but remained silent.</p><p>Every time her neighbor would hang her wash to dry, the young woman would make the same comments.</p><p><br></p><p>About one month later, the woman was surprised to see a nice clean wash on the line and said to her husband: “Look, she has learned how to wash correctly. I wonder who taught her this?”</p>', NULL, 'Adelaide', 1, '#ffffff', 'Yes', '2022-01-23 20:44:47', '2022-02-20 22:06:47'),
(294, 51, 7, 'Right Image Content', 'Traditional window cleaning method', 'traditional-window-cleaning-method', NULL, '171', NULL, '<p>In this method, cleaners use a rectangular bucket with a dolly and squeegee. They use the applicator to scrub the windows with soapy water or window cleaning chemical and squeegee to remove it and darts from the windows. Then using a dry cloth, they wipe the remaining water from the edges that the squeegee cannot remove.<br></p><p><br></p><p>The method is okay for the hand-reachable exterior windows only and, for interior windows, this is the only professional method. However, it becomes a risky job when cleaning high windows with a ladder or cleaning solar panels on a sloppy roof, even if you make the process safe by using a boom lift but still time-consuming and costly as well.</p><p><br></p>', NULL, 'Adelaide', 6, '#000000', 'Yes', '2022-01-23 21:01:21', '2022-02-20 22:13:17'),
(295, 51, 7, 'Left Image Content Without Title', 'window cleaning story', 'window-cleaning-story', NULL, '175', NULL, '<p>The husband said, “I got up early this morning and cleaned our windows.”</p><p>And so it is with life. What we see when watching others depends on the purity of the window through which we look.</p><p><br></p><p>It is a famous story about the importance of cleaning windows and sourced from https://freeology.com/teacher-humor/dirty-laundry</p><p><br></p><p>We believe you already realized your windows need cleaning and looking for a service provider, that’s why you are here.</p><p><br></p><p>However, we are sharing our knowledge and experience with you to choose the right window cleaners.</p>', NULL, 'Adelaide', 2, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-02-20 22:06:47'),
(296, 51, 7, 'Left Image Content Without Title', 'Window cleaning quote system continues', 'window-cleaning-quote-system-continues', NULL, '173', NULL, '<p>&nbsp;Finally, the quote based on the number of window panes is a very straightforward pricing system. Based on your provided information, we can provide an exact quote with no surprise increase on the job day.</p><p><br></p><p>Still, the price can be increased considering accessibility, height, and size of the panes but not significantly.</p><p><br></p><p>When you ask for a window cleaning quote from us, we will send you a form for the required information and provide you with the approximate quote. Since we charge based on the height, size, and the number of window panes so, our pricing is easy to understand.</p><p><br></p><p><strong>Now, which cleaning method to go for, confused?</strong></p><p>No worries, we are here to help. There are two window cleaning methods cleaners use.</p>', NULL, 'Adelaide', 4, '#ffffff', 'Yes', '2022-01-30 20:12:49', '2022-02-20 22:12:58'),
(298, 51, 7, 'Right Image Content Without Title', 'water fed pole system continue', 'water-fed-pole-system-continue', NULL, '170', NULL, '<p>Although, there is a debate that, RO - reverse omission system does the job quicker and is mostly preferred for commercial property window cleaning. It can do the job quicker than the DI (De-Ionized) water purifying system.</p><p><br></p><p>Oz Cleaners use DI (De-Ionized) water purifying system with its water-fed pole for outside window cleaning from the first story and a traditional window cleaning system for inside window cleaning.</p><p><br></p><p>We can reach up to three stories windows from the ground and able to extend the pole up to six stories, considering the job size. This system makes the job smooth and easy to clean skylight or solar panels.<br></p><p><br></p><p>Additionally, as part of our end-of-lease cleaning services, we use the traditional method only for window cleaning. We don’t clean any high windows that we can’t reach by hand or a three steps ladder.<br></p>', NULL, 'Adelaide', 8, '#ffffff', 'Yes', '2022-01-31 20:20:33', '2022-02-20 22:13:51'),
(299, 51, 7, 'Right Image Content', 'To provide the following service we charge extra in our regular carpet steam cleaning service in Adelaide:', 'to-provide-the-following-service-we-charge-extra-in-our-regular-carpet-steam-cleaning-service-in-adelaide', NULL, '178', NULL, '<p><strong>Security screen and fly-screen cleaning:</strong></p><p>We charge extra to wash and clean the door security screen and fly-screen.</p><p><br></p><p><strong>Windows with security screen:</strong></p><p>In our regular window cleaning service, we remove the fly-screen to clean the window but, charge extra if a security screen is attached to the window.</p><p><br></p><p><strong>Hard water marks cleaning:<br></strong></p><p>Cleaning hard watermarks from the window is a very complex job, and we cannot guarantee it will be all gone. However, we will do our best to make it entirely clean. At least we can make it far better than before and will charge extra for that upon discussing with our team on site.</p>', NULL, 'Adelaide', 13, '#ffffff', 'Yes', '2022-01-31 20:30:15', '2022-02-20 22:16:22'),
(300, 51, 7, 'Left Image Content Without Title', 'Skylights cleaning', 'skylights-cleaning', NULL, '179', NULL, '<p><strong>Acid wash to remove mold:</strong></p><p>Sometimes mold grows on your windows, and to clean those requires a thorough acid wash of your window. We can do this job very efficiently and charge extra to make your windows crystal clear again.</p><p><br></p><p><strong>Skylights cleaning:<br></strong></p><p>We charge extra for skylight cleaning based on the height and complexity to do the job effectively.</p>', NULL, 'Adelaide', 14, '#ffffff', 'Yes', '2022-01-31 20:34:40', '2022-02-20 22:17:04'),
(301, 51, 7, 'Left Image Content', 'Water fed pole system', 'water-fed-pole-system', NULL, '172', NULL, '<p>In this method, cleaners use a telescopic pole with a window scrubbing brush on top. A pure de-ionized water line is attached to the cleaning brush through the water fade pole to dispense soapy water to scrub and purify water from the filter attached to the system.</p><p><br></p><p>Since using purified water, there won’t be any dirty watermark on your windows. The process is safe, requires less time, and is even better than the traditional method.</p><p><br></p><p>To purify the water some cleaners use RO (Rivers Omission) water purifying system and, some cleaners use DI (De-Ionized) water purifying system. Both systems give you the same result and, it is just cleaner’s choice, which purifying method they will use.</p>', NULL, 'Adelaide', 7, '#ffffff', 'Yes', '2022-01-31 20:38:41', '2022-02-20 22:13:33'),
(302, 51, 7, 'Right Image Content', 'Things we don\'t do as standard in our regular window cleaning services', 'things-we-dont-do-as-standard-in-our-regular-window-cleaning-services', NULL, '133', NULL, '<p><ul><li>Lifting heavy items or furniture to make spaces for window cleaning.</li><li>Inaccessible outside windows by the water fade pole system for the narrow spaces.</li><li>Fly-screens for higher windows can’t be open from inside of the property.</li></ul></p>', NULL, 'Adelaide', 18, '#ffffff', 'Yes', '2022-01-31 21:00:28', '2022-02-20 22:06:47'),
(303, 51, 7, 'Left Image Content', 'Window cleaning in Adelaide, satisfaction guaranteed', 'window-cleaning-in-adelaide-satisfaction-guaranteed', NULL, '149', NULL, '<p>a) Our guarantee means we will return free of charge to rectify any issues the agent (for end-of-lease cleaning) or you have with our window cleaning service.</p><p><br></p><p>b) To claim a guarantee, you need to email us within 7 calendar days with the exit report and the agent\'s details. Any complaint will only be accepted in writing by email with photos.</p><p><br></p><p>c) No exceptions to the 7 calendar days condition unless discussed in writing by email before the job is done. It may take up to 3 working days to rectify the issues raised by your agent.</p><p><br></p><p>d) In the case of any cleaning complaint, we require either the customer or the property manager to check the work. While our cleaners are still present on the property, please make sure complaints have been fixed to the standard you want.</p><p><br></p><p><strong>With our unstoppable desire to grow the business, we can assure you, for one thing, you will never regret choosing us.</strong></p>', NULL, 'Adelaide', 19, '#ffffff', 'Yes', '2022-02-01 16:22:54', '2022-02-20 22:06:47'),
(304, 51, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 12, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-02-20 22:06:47'),
(305, 51, 7, 'Right Image Content', 'Window cleaning quote system', 'window-cleaning-quote-system', NULL, '174', NULL, '<p>There are three ways window cleaners give a quote<br></p><p><strong>1. Hourly basis</strong></p><p><strong>2. Property size basis and</strong></p><p><strong>3. Based on the number of panes you have</strong></p><p>&nbsp;</p><p>We don’t want to go for the first one. Cleaning time is different for different people with experiences and window cleaning equipment use. Also, a professional window cleaner will charge you an average of $60-90/hour and sometimes even more.</p><p><br></p><p>Property size basis quote is good if you get it on site; someone gave you a quote after visiting your property. To avoid price confusion on the job, try not to accept any quote online or over the phone based on the property size.</p><p><br></p><p>Every property designs are different, and so the number of windows is. Cleaners can increase the price significantly on the job, after looking at the type of windows and number of panes.</p>', NULL, 'Adelaide', 3, '#ffffff', NULL, '2022-02-19 18:24:51', '2022-02-20 22:06:47'),
(306, 51, 7, 'Left Image Content', 'Window cleaning service frequency', 'window-cleaning-service-frequency', NULL, '181', NULL, '<p>It totally depends on your choice, how frequently you want it done. Most of our clients require a quarterly window cleaning in Adelaide and some biannually. Very few individuals require it yearly as well.<br></p><p><br></p><p>However, we suggest a biannual window cleaning is enough if you are not located in front of a very busy road.</p><p><br></p><p><strong>Window cleaning service inclusion:</strong></p><p>Our window cleaning service ensures that your window panes are streak-free and sparkling clean. In our standard window cleaning we do the following:</p><p>&nbsp;</p><p><span style=\"white-space:pre\">	</span>Thoroughly clean inside and outside of all windows</p><p><span style=\"white-space:pre\">	</span>Wipe window tracks and sills, vacuum if required</p><p><span style=\"white-space:pre\">	</span>Remove fly-screens and reinstall after cleaning the windows</p>', NULL, 'Adelaide', 11, '#ffffff', NULL, '2022-02-19 18:53:13', '2022-02-20 22:15:31'),
(307, 51, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 9, '#ffffff', NULL, '2022-02-20 19:33:47', '2022-02-20 22:06:47'),
(308, 51, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 17, '#ffffff', NULL, '2022-02-20 19:34:38', '2022-02-20 22:06:47'),
(309, 51, 7, 'Right Image Content Without Title', 'Solar Panel Cleaning', 'solar-panel-cleaning', NULL, '177', NULL, '<p><strong>Solar panel cleaning:</strong></p><p>A clean solar panel produces more energy than the dirty one, and that’s why regular solar panel cleaning is so important. We charge based on your roof type and height for solar panel cleaning.</p><p><br></p><p><strong>Cleaning construction materials:</strong></p><p>Cleaning cement, paints, silicon, stickers, etc. from the windows is not a part of our regular window cleaning service. However, if you require then we will charge extra for that on-site.<br></p>', NULL, 'Adelaide', 15, '#ffffff', NULL, '2022-02-20 20:33:57', '2022-02-20 22:17:18'),
(310, 51, 7, 'Left Image Content Without Title', 'High rise window cleaning', 'high-rise-window-cleaning', NULL, '180', NULL, '<p><strong>Cleaning inside high windows:</strong></p><p>Sometimes we cannot reach some high window inside by hand or step ladder, especially in the staircase this happens most. Since it requires extra effort and cannot use the water-fed pole system inside, we charge extra for higher window cleaning inside.</p><p><br></p><p><strong>Mirrors Cleaning:</strong></p><p>For a small extra cost, we will clean your cupboard sliding mirror so that you can see your spotless smiling face again!&nbsp;</p><p><br></p><p><strong>Shower Screens Cleaning:</strong></p><p>Besides our regular window cleaning services, you can add your show screen to be sparkling again, as an extra service. The quoted price online may vary on-site based on the difficulties and condition of your shower screens.</p><p><br></p>', NULL, 'Adelaide', 16, '#ffffff', NULL, '2022-02-20 20:36:36', '2022-02-20 22:18:05'),
(311, 53, 7, 'Bullets Vertical', 'Some important things you should know before booking our solar panel cleaning services:', 'some-important-things-you-should-know-before-booking-our-solar-panel-cleaning-services', NULL, '168', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 15, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-05-14 13:02:14'),
(312, 53, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 4, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-05-14 12:58:09'),
(313, 53, 7, 'Term Title', 'Solar Panel Cleaning', 'solar-panel-cleaning', NULL, '182', 183, '<p><span style=\"font-size: 1rem;\"><span style=\"font-size: 13.5pt; font-family: lucida, &quot;serif&quot;;\" lang=\"EN-AU\">We are<strong> OZ CLEANERS!!!</strong></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\">Our solar panel cleaning process begins with checking the condition of the wiring, and system brackets, and a visual check of solar panels, inverter, and silicone connections.</span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\"><strong><br></strong></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\">Moreover, we are 100% insured.&nbsp;</span></font>If any damage is caused by us while cleaning your solar panels, though it’s very unlikely to happen, our insurance company will cover the cost to fix it.</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><strong style=\"font-size: 18px; font-family: lucida, serif;\"><br></strong></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><strong style=\"font-size: 18px; font-family: lucida, serif;\">Is not that awesome !!!</strong><br></p>', NULL, 'Adelaide', 0, '#ffffff', 'Yes', '2022-01-19 18:19:32', '2022-05-14 12:58:09'),
(314, 53, 7, 'Why Choose Us', 'Why choose us', 'why-choose-us', NULL, '50', NULL, '<p>Services we provide</p>', NULL, 'Adelaide', 8, '#f5f5f5', 'Yes', '2022-01-23 10:25:14', '2022-05-14 12:58:09'),
(315, 53, 7, 'Right Image Content', 'Solar Panel & Skylight Cleaning <span>In Adelaide</span>', 'solar-panel-and-skylight-cleaning-in-adelaide', NULL, '210', NULL, '<p>Our solar panel cleaning process begins with checking the condition of the wiring, and system brackets, and a visual check of solar panels, inverter, and silicone connections. Moreover, we are 100% insured.</p><p>If any damage is caused by us while cleaning your solar panels, though it’s very unlikely to happen, our insurance company will cover the cost to fix it.</p><br><br><br>', NULL, 'Adelaide', 1, '#ffffff', 'No', '2022-01-23 20:44:47', '2022-05-14 12:58:09'),
(316, 53, 7, 'Right Image Content Without Title', 'water fed pool', NULL, NULL, '278', NULL, '<p>We use a water system with a carbon fiber telescopic pole, and soft brushes to clean your solar panels and skylights.</p><p>We\r\n also perform De-Ionization water cleaning to ensure that the skylights \r\nand solar panels are free of scratch, dust, and pathogens.</p><p>All our efforts are concentrated to ensure complete client satisfaction when providing you with our highly skilled services.</p><p><br></p><p><br></p>', NULL, 'Adelaide', 6, '#000000', 'Yes', '2022-01-23 21:01:21', '2022-05-14 16:33:43'),
(317, 53, 7, 'Left Image Content', 'Professional solar panel and skylight cleaning services by industry experts', 'professional-solar-panel-and-skylight-cleaning-services-by-industry-experts', NULL, '275', NULL, '<p>If you have solar panels or skylights on your roof then you need to clean it regularly for a better outcome. If you don’t have a solar panel or skylights on your roof then, forget about skylights cleaning but you should install solar panels as soon as possible not for cleaning but for saving the environment and money.</p><p>Electricity generated via your solar system means that you draw less electricity from the grid. It means less coal is burnt at power stations, reducing the use of the biggest source of carbon pollution.</p><p>Installing a system is the single most effective step you can take toward reducing your carbon footprint. Also, be a part of the great initiative taken by the Australian government, and be a 100% renewable energy user by 2030.</p><p>To find out more details about it you can&nbsp;<a href=\"http://www.cleanenergyregulator.gov.au/RET/About-the-Renewable-Energy-Target\" style=\"font-size: 1rem; display: inline !important;\">visit here</a>.</p><br>', NULL, 'Adelaide', 2, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-05-18 07:38:55');
INSERT INTO `term_custom_fields` (`id`, `content_term_id`, `content_term_parent_id`, `content_type`, `content_title`, `content_seo_url`, `content_sub_title`, `content_image`, `content_page_banner`, `content_details`, `content_short_details`, `content_zone`, `sorting_order`, `bg_color`, `is_active`, `created_at`, `updated_at`) VALUES
(318, 53, 7, 'Left Image Content', 'How often should I do the solar panel and skylight cleaning?', 'how-often-should-i-do-the-solar-panel-and-skylight-cleaning', NULL, '350', NULL, '<p>We at Oz Cleaners recommend that solar panels should be cleaned and inspected at a minimum once every six months. Solar panel cleaning at regular intervals prevents the buildup of residue and keeps your panels operating optimally at all times.</p><p>&nbsp;OZ Cleaners takes pride in introducing itself as a leading company providing solar panel and skylight cleaning services in Adelaide. For over a decade, we are cleaning solar panels and skylights to help promote aesthetics, health, and well-being.</p><p>Skylights are placed in direct line with the roof surface to maximize the coming of natural sunlight inside the building. Its placement also exposes it to falling debris, weather, bird droppings, and other natural conditions that cause tainting. If not cleaned regularly, these result in stains difficult to remove.</p><p>At OZ Cleaners, we use top-grade cleaning agents to clean the surface grime and dirt from skylights and solar panels in surrounding areas.</p><br>', NULL, 'Adelaide', 5, '#ffffff', 'Yes', '2022-01-30 20:12:49', '2022-05-17 09:47:44'),
(319, 53, 7, 'Right Image Content', 'Solar panel and skylight cleaning service types at Oz Cleaners:', 'solar-panel-and-skylight-cleaning-service-types-at-oz-cleaners', NULL, '280', NULL, '<p>•&nbsp;&nbsp; &nbsp;Regular solar panel and skylight cleaning at a discounted price.</p><p>•&nbsp;&nbsp; &nbsp;One-off solar panel and skylight cleaning at a very affordable price.</p><p>•&nbsp;&nbsp; &nbsp;Small residential jobs to the large industrial project, we can handle anything.</p>', NULL, 'Adelaide', 10, '#ffffff', 'Yes', '2022-01-31 20:20:33', '2022-05-14 16:50:56'),
(322, 53, 7, 'Left Image Content', 'Our solar panel and skylight cleaning process', 'our-solar-panel-and-skylight-cleaning-process', NULL, '172', NULL, '<p>•&nbsp;&nbsp; &nbsp;Our solar panel cleaning process begins with a thorough checking of the wiring, and system brackets, and a visual check of solar panels, inverter, and silicone connections. Moreover, we are 100% insured.</p><p>•&nbsp;&nbsp; &nbsp;Once we determine the extent of damage and cleaning needs, we start cleaning the solar panels and skylights with our de-ionized water purifying system to ensure a thorough clean and maximum efficiency. Our water filtering system is also regularly checked with a TDS meter.</p><p>•&nbsp;&nbsp; &nbsp;Once cleaned, we use pure water to rinse the panels off. Our solar panel and skylight cleaning services have been designed to be completely safe and chemical-free to ensure that your rainwater storage tanks are not harmed.</p>', NULL, 'Adelaide', 7, '#ffffff', 'Yes', '2022-01-31 20:38:41', '2022-05-14 12:58:09'),
(324, 53, 7, 'Left Image Content', 'Solar panel and skylight cleaning - satisfaction guarantee', 'solar-panel-and-skylight-cleaning---satisfaction-guarantee', NULL, '149', NULL, '<p>a) Our guarantee means we will return free of charge to rectify any issues the agent (for end-of-lease cleaning) or you have with our window cleaning service.</p><p><br></p><p>b) To claim a guarantee, you need to email us within 7 calendar days with the exit report and the agent\'s details. Any complaint will only be accepted in writing by email with photos.</p><p><br></p><p>c) No exceptions to the 7 calendar days condition unless discussed in writing by email before the job is done. It may take up to 3 working days to rectify the issues raised by your agent.</p><p><br></p><p>d) In the case of any cleaning complaint, we require either the customer or the property manager to check the work. While our cleaners are still present on the property, please make sure complaints have been fixed to the standard you want.</p><p><br></p><p><strong>With our unstoppable desire to grow the business, we can assure you, for one thing, you will never regret choosing us.</strong></p>', NULL, 'Adelaide', 11, '#ffffff', 'Yes', '2022-02-01 16:22:54', '2022-05-14 12:59:12'),
(325, 53, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 14, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-05-14 12:58:09'),
(326, 53, 7, 'Right Image Content', 'Now the big question is why solar panels and skylights need cleaning?', 'now-the-big-question-is-why-solar-panels-and-skylights-need-cleaning', NULL, '276', NULL, 'Solar panels can get dirty quickly from dust, pollen, tree and bird droppings, pollution, and traffic staining since they are exposed to natural elements.<br><p>According to the research studies conducted by SEPA Solar Electric Power Association and various other organizations, regular solar panel cleaning and maintenance can improve the efficiency of your solar panels by up to 30%.<br>With this massive increase in efficiency, your solar panels will operate more cost-effectively. Homeowners should seriously consider regular solar panel cleaning.<br>Think of a clean car windscreen versus a windscreen not cleaned in 6 months. Solar panels give an optimal output when able to reflect 100% sunlight, and for this, the panels must remain clean.<br>Same with the skylights cleaning, those were fixed on the roof to get direct sunlight, right? Then why you will allow darts, lichens, etc to block it? Clean skylights mean more and more sunlight inside the room. Who doesn’t love it and so, it requires regular cleaning too.<br></p>', NULL, 'Adelaide', 3, '#ffffff', 'Yes', '2022-02-19 18:24:51', '2022-05-14 13:21:32'),
(328, 53, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 9, '#ffffff', NULL, '2022-02-20 19:33:47', '2022-05-14 12:58:09'),
(332, 7, 3, 'Bullets Vertical', 'Know before booking our end of lease cleaning services:', 'know-before-booking-our-end-of-lease-cleaning-services', NULL, '136', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 18, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-02-11 18:45:02'),
(333, 7, 3, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 4, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-02-11 19:25:57'),
(334, 7, 3, 'Side by Side Bullets', 'End of lease cleaning service inclusion:', 'end-of-lease-cleaning-service-inclusion', NULL, NULL, NULL, '<p class=\"MsoNoSpacing\" style=\"text-align:justify;text-justify:inter-ideograph\"><span lang=\"EN-IN\" style=\"font-size:13.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#111111;letter-spacing:-.15pt;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm\">A general end-of-lease cleaning\r\nrequires the property to be empty. If there are any items in the cupboards, on\r\nthe floors, benchtop, etc., we will clean around those. We will not be\r\nresponsible for moving any items for the space to be cleaned.<o:p></o:p></span></p>', 'For following service we charge extra in our end of lease cleaning services', 'Adelaide', 7, '#ffffff', NULL, '2021-10-22 11:08:23', '2022-02-19 18:42:26'),
(335, 7, 3, 'Term Title', 'End of Lease <span>Cleaning</span>', 'end-of-lease-cleaning', NULL, '88', 139, '<p><span style=\"font-size: 1rem;\"><span lang=\"EN-AU\" style=\"font-size: 13.5pt; font-family: lucida, &quot;serif&quot;;\">We are<strong> OZ CLEANERS!!!</strong></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\">Leaving home? And worried about getting back your bond 100%? Don’t worry, we got you, we are professionals and very reasonable.</span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\"><br></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\">Doesn\'t matter how picky a real estate agent you got, with our moving out cleaning we provide 100% bond back guarantee. Our professional teams are ready to help, 7 days in a week.</span></font></p><p><br></p>', NULL, 'Adelaide', 0, '#ffffff', 'Yes', '2022-01-19 18:19:32', '2022-02-19 18:13:46'),
(336, 7, 3, 'Why Choose Us', 'Why choose us', 'why-choose-us', NULL, '50', NULL, '<p>Services we provide</p>', NULL, 'Adelaide', 3, '#f5f5f5', 'Yes', '2022-01-23 10:25:14', '2022-02-11 18:45:02'),
(337, 7, 3, 'Right Image Content', 'Bond Cleaning <span>In Adelaide</span>', 'bond-cleaning-spanin-adelaide', 'We work relentlessly to get your bond back and provide ultimate cleaning.', '103', NULL, '<p>As an end of lease cleaning service provider in Adelaide, we are not the best, but still, our competitors hate us.\r\n\r\nNo, wrong if you think because we charge the least money to provide any end of lease cleaning service.&nbsp;</p><p><br></p><p>We must say we are not the cheapest but affordable than many other competitors in the market.\r\n\r\nOther bond cleanings or exit cleaning service providers hate us because our clients love us.&nbsp;</p><p><br></p><p>They do marketing for us to their friends and families. They advise us about how to make our service better and so on.</p>', NULL, 'Adelaide', 1, '#ffffff', 'Yes', '2022-01-23 20:44:47', '2022-02-11 18:45:02'),
(338, 7, 3, 'Left Image Content', 'Bond back guaranteed', 'bond-back-guaranteed', NULL, '108', NULL, '<p>Our thorough cleaning will ensure that the property is good enough for you to get 100% bond money back as a tenant.</p><p><br></p><p>Agents and landlords to the other side will have no problem getting new bonds with a clean property.<br></p><p><br></p><p>We have a full range of cleaning equipment and experienced teams to carry out a comprehensive end-of-lease cleaning for you. We have options to choose from our tailored packages or customize one that suits your needs.</p>', NULL, 'Adelaide', 6, '#000000', 'Yes', '2022-01-23 21:01:21', '2022-02-11 18:45:02'),
(339, 7, 3, 'Left Image Content Without Title', 'Exit Cleaning is an <span>Art</span>', 'exit-cleaning-is-an-spanartspan', NULL, '107', NULL, '<p>To beat the competition, now most cleaning companies provide a 100% bond back guarantee with their bond cleaning services. No doubt everyone\'s finger crosses for no issues after leaving the property.&nbsp;</p><p><strong><br></strong></p><p><strong>However, bad situations come, mistakes happen, and it\'s normal, correct?</strong></p><p>It happens with us as well. We also need to go back sometimes to a job a second time when your agent finds any issues with our cleaning services.</p>', NULL, 'Adelaide', 2, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-02-11 18:45:02'),
(340, 7, 3, 'Right Image Content', 'We respect our clients', 'we-respect-our-clients', NULL, '104', NULL, '<p>We stand out from our competitors by providing the best after-sales service. We even hire other professionals for our clients, if there is something you need and we don\'t do.</p><p><br></p><p>For example, gardener, painter, handymen, etc. If you book with us and let us know you need those services then we will provide you our contact list for those jobs or contact for you with them.</p><p><br></p><p>We make moving out a less stressful affair for you with real estate agents by our professional exit cleaning services, and that\'s our promise.</p>', NULL, 'Adelaide', 5, '#ffffff', 'Yes', '2022-01-30 20:12:49', '2022-02-11 18:45:02'),
(341, 7, 3, 'Right Image Content', 'To provide the following service we charge extra in our end of lease cleaning service Adelaide:', 'to-provide-the-following-service-we-charge-extra-in-our-end-of-lease-cleaning-service-adelaide', NULL, '127', NULL, '<p><strong>Carpet steam cleaning:</strong></p><p>It is considered an extra service since every property doesn’t have carpets. In our regular end of lease cleaning service package, we use a carpet shampooing machine if carpet cleaning is required.</p><p><br></p><p>However, if you want carpet steam cleaning, please book it separately or discuss it with our friendly team.</p>', NULL, 'Adelaide', 9, '#ffffff', 'Yes', '2022-01-31 20:17:01', '2022-02-11 18:45:02'),
(342, 7, 3, 'Right Image Content Without Title', 'Exterior window cleaning:', 'exterior-window-cleaning', NULL, '129', NULL, '<p><strong>Exterior window cleaning:</strong></p><p>We can’t predict how big the windows are or how many panes are there without visiting the property. We assume a price based on the property details you provided in our system.</p><p><br></p><p>However, the price may vary based on the number of panes, high windows, jobs difficulties, etc. There is a higher chance of damage when we open and re-install fly screens after cleaning.</p><p><br></p><p>That’s why we ask our clients to keep the fly-screens removed before we start and re-install when we finish. Or else, we will avoid those glasses.</p>', NULL, 'Adelaide', 11, '#ffffff', 'Yes', '2022-01-31 20:20:33', '2022-02-11 18:45:02'),
(343, 7, 3, 'Left Image Content Without Title', 'Spot Cleaning from walls:', 'spot-cleaning-from-walls', NULL, '126', NULL, '<p><strong>Spot Cleaning from walls:</strong><br></p><p>Most people think it should be on the general cleaning list, but we know this can be the hardest part of the job. The price we quote over the phone or in our system is just an approximate idea.</p><p><br></p><p>Based on the condition of the walls, we will decide the actual amount after discussing with you when our team is on-site.</p><p><strong><br></strong></p><p><strong>Garage cleaning:</strong></p><p>In garage cleaning, we sweep and vacuum the floor, remove the cobwebs, dust the walls, and clean the skirting boards only.</p>', NULL, 'Adelaide', 12, '#ffffff', 'Yes', '2022-01-31 20:30:15', '2022-02-11 18:45:02'),
(344, 7, 3, 'Right Image Content Without Title', 'Blinds cleaning:', 'blinds-cleaning', NULL, '124', NULL, '<p><strong>Blinds cleaning:\r\n</strong></p><p>There are different types of blinds, and some seem very easy to clean but take too much time that you can’t even imagine. That’s why we charge extra for general blind cleaning. Please note, we don’t clean curtains at all, but you can go to this website for a quote.</p><p><strong><br></strong></p><p><strong>Balcony cleaning:</strong></p><p>We do not scrub the balcony but sweep, vacuum, and mop. Also, clean the outside glasses of the sliding doors when the balcony is considered an extra service.</p>', NULL, 'Adelaide', 13, '#ffffff', 'Yes', '2022-01-31 20:34:40', '2022-02-11 18:45:02'),
(345, 7, 3, 'Left Image Content Without Title', 'Air-conditioner vent cleaning:', 'air-conditioner-vent-cleaning', NULL, '128', NULL, '<p><strong>Air-conditioner vent cleaning:</strong><br></p><p>We can quote for this only when our team is on-site, and they can do it since it can be a critical job. The price depends based on the difficulties and cleaning requirements upon discussion.</p><p><br></p><p><strong>Exterior house cleaning:</strong></p><p>This includes sweeping the outside area, removing cobwebs, and washing the whole house by hose pipe. No pressure washing is included in this service. If you need to remove any oil stains or something like that, please discuss it with our friendly team.<br></p>', NULL, 'Adelaide', 14, '#ffffff', 'Yes', '2022-01-31 20:50:03', '2022-02-11 18:45:02'),
(346, 7, 3, 'Right Image Content', 'Things we don\'t in our regular end of lease cleaning service Adelaide:', 'things-we-dont-in-our-regular-end-of-lease-cleaning-service-adelaide', NULL, '133', NULL, '<p></p><ul><li>Cleaning ceilings or anything more than 3 meters high, for example, windows if was not discussed before.</li><li>Lifting heavy items and furniture to clean underneath or inaccessible areas or corners by hand, mop, or vacuum.</li><li>Cleaning inside appliances if not booked as an extra service like fridge, washing machine, etc.</li></ul><p></p>', NULL, 'Adelaide', 16, '#ffffff', 'Yes', '2022-01-31 21:00:28', '2022-02-11 18:45:02'),
(347, 7, 3, 'Left Image Content', 'End of lease cleaning - bond back guarantee:', 'end-of-lease-cleaning---bond-back-guarantee', NULL, '134', NULL, '<ul><li>Bond back guarantee means we return for free to rectify any issues your agent has from our checklist.</li><li>To claim a guarantee, you need to email us within 7 calendar days with the exit report and the agent\'s details. Any complaint will only be accepted in writing by email with photos.</li><li>In the case of any cleaning complaint, we require either the customer or the property manager to check the work. While our cleaners are still present on the property, please make sure complaints have been fixed to the standard you want.</li><li>With our unstoppable desire to grow the business, we can assure you, for one thing, you will never regret choosing us.</li></ul>', NULL, 'Adelaide', 17, '#ffffff', 'Yes', '2022-02-01 16:22:54', '2022-02-11 18:45:02'),
(348, 7, 3, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 8, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-02-11 19:26:10'),
(349, 7, 3, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 15, '#ffffff', NULL, '2022-02-11 18:42:46', '2022-02-11 19:26:26'),
(368, 55, 7, 'Bullets Vertical', 'Some important things you should know before booking our tile and grout cleaning services:', 'some-important-things-you-should-know-before-booking-our-tile-and-grout-cleaning-services', NULL, '288', NULL, '<p>For the following service, we charge extra for our tile and grout&nbsp; cleaning services</p><h4><hr></h4><p></p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 14, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-05-15 08:08:13'),
(369, 55, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 7, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-05-15 08:08:13');
