"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->\r\n\r\n<p class=\"MsoNormal\">To keep your tile and grout looking beautiful for a long\r\ntime. We\'ve arrived. The most popular option among our tile and grout cleaning\r\nservices is steam cleaning, which removes stains and color from deep inside the\r\ngrout.</p>\r\n\r\n<p class=\"MsoNormal\">We are committed to keeping your house healthy, fresh, and\r\nattractive. Our professional tiles and grout cleaners provide fantastic service\r\nwith customers\' 100% satisfaction at a reasonable price.</p><p class=\"MsoNormal\"><strong style=\"font-size: 18px; font-family: lucida, serif;\">Is not that awesome !!!</strong></p>\r\n\r\n<p><br></p>', NULL, 'Adelaide', 0, '#ffffff', 'Yes', '2022-01-19 18:19:32', '2022-05-15 08:08:13'),
(372, 55, 7, 'Why Choose Us', 'Why choose us', 'why-choose-us', NULL, '50', NULL, '<p>Services we provide</p><p><br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\" id=\"docs-internal-guid-800757db-7fff-8ad4-d960-363d80cc71fb\"><span style=\"font-size:12pt;font-family:\'Times New Roman\';color:#0e101a;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Why choose Oz Cleaners for your tile and grout cleaning?</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\';color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\';color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">ü We are eco-friendly, know our job, and understand what you are looking for.</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\';color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">ü We are fully insured to cover any damage by our team while doing your job.</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\';color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">ü We never forget you after providing our services, build a lifelong relationship.</span></p>', NULL, 'Adelaide', 6, '#f5f5f5', 'Yes', '2022-01-23 10:25:14', '2022-05-15 08:08:13');
INSERT INTO `term_custom_fields` (`id`, `content_term_id`, `content_term_parent_id`, `content_type`, `content_title`, `content_seo_url`, `content_sub_title`, `content_image`, `content_page_banner`, `content_details`, `content_short_details`, `content_zone`, `sorting_order`, `bg_color`, `is_active`, `created_at`, `updated_at`) VALUES
(373, 55, 7, 'Right Image Content', 'Tile and grout cleaning <span>In Adelaide</span>', 'tile-and-grout-cleaning-spanin-adelaidespan', 'Please look for the result, not the time spent', '223', NULL, '<p>Can you answer one simple question, how to clean your tiled floor when it is messy? The simple answer is to vacuum first and then mop. Yes, you are right, and that’s the normal process.</p><p>Have you ever thought about why the grout line is becoming dirty and turning black day by day?</p><p>Why is the tile color becoming shady day by day? Though you are cleaning your tile and grout area whenever it is becoming dirty!</p>&nbsp;The reason is, when you vacuum your floors, it sucks most of the dry darts but not the wet materials, depending on the vacuum cleaner you use.<p>Then when you mop the floor, some dirty water gets stuck between the grout line. And, of course, some remain on top of the tile as well.<br></p><br>', NULL, 'Adelaide', 1, '#ffffff', 'Yes', '2022-01-23 20:44:47', '2022-05-15 08:08:13'),
(374, 55, 7, 'Right Image Content', 'Tile and grout cleaning - satisfaction guarantee', 'tile-and-grout-cleaning---satisfaction-guarantee', NULL, '284', NULL, '<br><ul><li>Our guarantee means we will return free of charge to rectify any issues the agent (for end-of-lease cleaning) or you have with our window cleaning service.</li><li>To claim a guarantee, you need to email us within 7 calendar days with the exit report and the agent\'s details. Any complaint will only be accepted in writing by email with photos.</li><li>No exceptions to the 7 calendar days condition unless discussed in writing by email before the job is done. It may take up to 3 working days to rectify the issues raised by your agent.</li></ul><ul><li>In the case of any cleaning complaint, we require either the customer or the property manager to check the work. While our cleaners are still present on the property, please make sure complaints have been fixed to the standard you want.</li></ul><br><p>With our unstoppable desire to grow the business, we can assure you, for one thing, you will never regret choosing us.</p>', NULL, 'Adelaide', 12, '#000000', 'Yes', '2022-01-23 21:01:21', '2022-05-15 08:08:13'),
(375, 55, 7, 'Left Image Content Without Title', 'How do we clean your tile and grout?', 'how-do-we-clean-your-tile-and-grout', NULL, '222', 222, '<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><strong></strong></p><p>On running your finger along a grout line, you may feel \r\ngreasy. It is because of constant mopping or conventional cleaning. It \r\ntends to loosen the dirt, move it around, and deposit it in the grout \r\nlines.</p><h4>How do we clean your tile and grout?</h4><p><br></p><p>So tile and grout cleaning should be done regularly to \r\nenjoy the healthy new look again and again like your steam cleaned \r\ncarpet.</p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\">First, we spray our specialized tile and grout cleaning solution on your tiled floor. Then wait for 15-20 minutes to break the darts on the tile and grout to make it easier to clean.<br>After that, we bring our high-pressure cleaning machine, attached with a vacuum, leaving no mess on the floors and bringing the best result in one go. It is designed for internal use only.<br>When the rotary pressure washing nozzle loosens the darts from tile and grout, the vacuum surrounding it sucks the dirty water from the floor.<br>The rotary machine moves and your sparkling clean tiled floor comes in front.<br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\">Once the machine starts, the job is easy and quick. But it requires experience and knowledge to prepare the floor before using the tile and grout cleaning machine. Otherwise, the job can be a nightmare to get a clean floor again, like new.<br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\">Some people do the tile &amp; grout cleaning manually due to a lack of specialized equipment and initial investment. They do the job manually scrubbing your tile and grout hours to clean it.<br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><br></p><br>', NULL, 'Adelaide', 2, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-05-15 08:08:13'),
(376, 55, 7, 'Right Image Content Without Title', 'kitchen', 'kitchen', NULL, '367', NULL, '<br><p><strong>Swimming pool tile cleaning:</strong></p><p>For external \r\nareas such as balcony, porch or poolside tile cleaning we can use the \r\nsame internal tile and grout cleaning machine. So those areas can be \r\nadded as an extra to our regular tile and grout cleaning services. It \r\ncan eliminate the hazards associated with a slippery surface too.<br></p><p><strong>Kitchen Bench top Cleaning:</strong></p><p>Your kitchen benchtop is a breeding ground for dirt and bacteria, so daily cleaning is a must! But don\'t just reach for the Spray and Wipe, certain benchtops can benefit from a more customized cleaning method like using a high-pressure tile and grout cleaning machine with hot water.</p>&nbsp;<br><br>', NULL, 'Adelaide', 9, '#0080ff', 'Yes', '2022-01-30 20:12:49', '2022-05-17 13:18:11'),
(377, 55, 7, 'Left Image Content', 'To provide the following service we charge extra in our tile and grout cleaning service Adelaide:', 'to-provide-the-following-service-we-charge-extra-in-our-tile-and-grout-cleaning-service-adelaide', NULL, '334', NULL, '<p><strong>Grout sealing:</strong></p><p>Sealing your tiles helps prevent &amp; reduce staining by keeping most stains suspended at the surface. It creates a barrier against chemical attack, deterioration, and contamination. It is the first important step towards protecting your investment against stains.</p>&nbsp;<br><p><strong>Tile regrouting:</strong></p><p>Tiles can often be in excellent condition, but the grout may have become deteriorated or damaged. It leaves entire areas looking dull and shabby. Tile regrouting will dramatically improve the appearance of any tiled area that has endured years of wear and tear.</p><p>From showers to bathrooms, kitchen spills to tiled flooring and walls, and think of your other tiled areas too. Regrouting can leave a tiled area looking fresh, clean, and like new for a fraction of the cost of replacing tiles.</p>&nbsp;<br><br><br>', NULL, 'Adelaide', 8, '#ffffff', 'Yes', '2022-01-31 20:17:01', '2022-05-16 13:50:29'),
(384, 55, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 10, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-05-15 08:08:13'),
(385, 55, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 13, '#ffffff', NULL, '2022-02-11 18:42:46', '2022-05-15 08:08:13'),
(386, 72, 7, 'Bullets Vertical', 'Some important things you should know before booking our oven & BBQ cleaning services:', '-some-important-things-you-should-know-before-booking-our-oven-and-bbq-cleaning-services', NULL, '269', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 12, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-05-14 11:35:14'),
(387, 72, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 5, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-05-13 12:12:18'),
(388, 72, 7, 'Right Image Content Without Title', 'IMAGE', 'image', NULL, '261', NULL, '<p class=\"MsoNoSpacing\" style=\"text-align:justify;text-justify:inter-ideograph\"><strong>Microwave Cleaning:</strong><span style=\"font-size:13.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#111111;letter-spacing:-.15pt;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm\" lang=\"EN-IN\"><br></span>A dirty microwave could be growing a smorgasbord of germs in it.<br>Germs need warmth, food, and moisture to multiply, and allowing the internal top of microwaves to be splattered with food particles and not cleaned after each use could pose a potential health risk.<br>Remaining particles from the day, or week, before will dislodge as steam softens the old food and causes it to drop and contaminate the new food, if not covered. <br>Splatters of food in your microwave look bad, smell bad, and decrease the efficiency of your microwave. These can also be the cause of fires in your microwave oven and can void your warranty if not cleaned off.<br></p><p class=\"MsoNoSpacing\" style=\"text-align:justify;text-justify:inter-ideograph\"><br></p><p class=\"MsoNoSpacing\" style=\"text-align:justify;text-justify:inter-ideograph\">It is best for your health and safety that you regularly clean your microwave oven.<span style=\"font-size:13.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#111111;letter-spacing:-.15pt;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm\" lang=\"EN-IN\"><strong><br></strong><o:p></o:p></span></p>', 'For following service we charge extra in our end of lease cleaning services', 'Adelaide', 7, '#ffffff', NULL, '2021-10-22 11:08:23', '2022-05-14 10:07:55'),
(389, 72, 7, 'Term Title', 'Oven & BBQ <span>Cleaning</span>', 'oven-and-bbq-spancleaningspan', NULL, '87', 230, '<p><span style=\"font-size: 1rem;\"><span style=\"font-size: 13.5pt; font-family: lucida, &quot;serif&quot;;\" lang=\"EN-AU\">We are<strong> OZ CLEANERS!!!</strong></span></span></p><p>Cleaning an oven and a BBQ may not be quite as exciting as cooking delicious barbecue meals, but maintaining a barbecue clean is essential to guarantee that your food tastes excellent and is safe to consume.</p><p>Are you ready for the next BBQ? Not a problem, start with us today.</p><p><strong>Our professionally trained team is always ready to help at an affordable price !!!</strong></p><br><br><br><br>', NULL, 'Adelaide', 0, '#ffffff', 'Yes', '2022-01-19 18:19:32', '2022-05-14 10:09:48'),
(390, 72, 7, 'Why Choose Us', 'Why choose us', 'why-choose-us', NULL, '50', NULL, '<p>Services we provide</p>', NULL, 'Adelaide', 4, '#f5f5f5', 'Yes', '2022-01-23 10:25:14', '2022-05-13 12:12:18'),
(391, 72, 7, 'Right Image Content', 'Oven and BBQ Cleaning <span>In Adelaide</span>', 'oven-and-bbq-cleaning-spanin-adelaidespan', 'A clean Oven and BBQ give fresh and delicious the pleasure of taking food to eat.', '256', NULL, '<p><br></p><p>When summer approaches, time to get your grill primed and ready for another season of backyard cookouts, burgers, and barbecues. And the very first step is to clean the entire grill of all remnants from last summer’s cooking adventures.</p><p>Even if you wiped down the grill before putting it away for the winter, it’s important to start each new grilling season with a thorough cleaning. Our oven &amp; BBQ cleaning expert will have your Oven &amp; BBQ running to the most effective (and delicious!) standards.</p><p>Clean your oven and BBQ cooker to cook healthy food.</p>', NULL, 'Adelaide', 1, '#ffffff', 'Yes', '2022-01-23 20:44:47', '2022-05-14 10:12:07'),
(392, 72, 7, 'Left Image Content', 'In our regular oven and BBQ cleaning service, you can add the following as an additional service:', 'in-our-regular-oven-and-bbq-cleaning-service-you-can-add-the-following-as-an-additional-service', NULL, '302', NULL, '<p><strong>Cooktop Cleaning:</strong></p><p>Cleaning your stovetop is important because it is an area of your kitchen that is most prone to grease, food grime, and bacteria buildups. It is also important to disinfect your stovetop, especially, if you are cooking with items like raw chicken. If you do not clean your stovetop, you could spread the bacteria and germs that come from the items you are cooking. Cleaning your stovetop will make your kitchen cleaner and reduce the chance of someone falling ill.</p><br><p><strong>Range hood Filter Cleaning:</strong></p><p>Cook and live in comfort with clean range hood filters. Your range hood is there to soak up the grease and smells from cooking. It keeps your air clean by removing airborne grease, helps remove excess heat, steam and smoke while cooking, and provides better kitchen lighting.</p><p>For optimum performance of your range hood, mesh filters should be cleaned every few weeks or months and, replaced every 1-2 years (depending on usage).</p><p>Cleaning a greasy range hood is certainly not an easy task, especially if you\'re doing it after a long time. The filter of your range hood accumulates a lot of grease, dirt, and debris, which often leads to the range hood losing its effectiveness.</p>', NULL, 'Adelaide', 6, '#000000', 'Yes', '2022-01-23 21:01:21', '2022-05-15 16:56:48'),
(393, 72, 7, 'Left Image Content', 'Here’s why you need a BBQ cooker and oven cleaning: <span> </span>', 'here’s-why-you-need-a-bbq-cooker-and-oven-cleaning-span-span', NULL, '303', NULL, '<p>The same grilling practices that make those Instagram-perfect, flavorful char marks on your burgers and steaks also produce carbon deposits. Virtually every surface of your grill, including the grates, hood, interior of the firebox, and burner tubes.</p><p>Those carbon deposits aren’t just ugly; grease and sugary sauces can stick to them and harbor bacteria. And excessive carbon buildup can cause the grill to heat unevenly. Not reaching full operating temperature may cause your gas-burner tubes to prematurely fail.</p><p>In terms of hygiene, it is not recommended that you cook food in an oven that is covered with burning excess of other meals and grease. It all sounds very dramatic, but it is true, a clean oven will produce better tasting food and will be able to prepare it in a quicker time. </p><p>An unclean oven will also perform poorly compared to a clean oven. It can lead to a buildup of smoke every time you open the door and can create temperature issues due to blocked filters. Overall, an unclean oven is not good for you or the appliance itself, so care should be taken into getting it cleaned.</p>', NULL, 'Adelaide', 2, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-05-15 17:16:53'),
(394, 72, 7, 'Right Image Content', 'Why should you hire professionals to clean your Oven & BBQ?', 'why-should-you-hire-professionals-to-clean-your-oven-and-bbq', NULL, '259', NULL, '<p>Oven cleaning is a task that we all know should be done, but we all don’t want to do it. It is messy, takes time, and involves using harsh chemicals to remove all that grime.</p><p>Even though it may not be a fun task, we know that it needs to be done, but not everyone is exactly sure why.</p><p>Hiring an oven and BBQ cleaning company for an oven cleaning service is a great idea, making sure that the oven cleaning is done correctly, saving you heaps of time and money in the long run.</p><p>They know how to do it properly, ensuring great results each time.</p><p>Professional Oven &amp; BBQ cleaning services will ensure that what is used to clean your grill is safe and that you are always ready for the next sunny weekend!</p><br>', NULL, 'Adelaide', 3, '#ffffff', 'Yes', '2022-01-30 20:12:49', '2022-05-13 12:38:05'),
(403, 72, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 11, '#ffffff', NULL, '2022-02-11 18:42:46', '2022-05-13 12:12:18'),
(404, 57, 7, 'Bullets Vertical', 'Know before booking our high-pressure cleaning services:', 'know-before-booking-our-high-pressure-cleaning-services', NULL, '411', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 17, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-05-24 17:04:05'),
(405, 57, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 4, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-05-24 17:04:05');
