Exception>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"></w:LsdException>\r\n </w:LatentStyles>\r\n</xml><![endif]--><span style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;color:black\"> When the substrates are hard and resistant to harm\r\nfrom pressure, an (Oz cleaner) professional pressure washing service is advised. They (Pro\r\nPressure Cleaning Service) will have the right ratios in a downstream injector\r\n(the device that suctions chemicals from the tank and into the hose) so that\r\nyou don\'t get too much or too little on your home\'s exterior.</span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ncolor:#202124;background:white\">&nbsp;</span></p>', NULL, 'Adelaide', 7, '#000000', 'Yes', '2022-01-23 21:01:21', '2022-05-24 17:04:05'),
(411, 57, 7, 'Left Image Content', 'Commonly Asked Questions Regarding  <span>Soft Washing vs. Pressure Washing</span>', 'commonly-asked-questions-regarding--spansoft-washing-vs-pressure-washingspan', NULL, '388', NULL, '<p>For years, homeowners have debated which method is best for washing the exterior of their home. Many people have most likely purchased or rented a pressure washer at least once and found how beneficial it can be.</p><p>Although pressure cleaning is the quickest way to remove dirt, soft washing, which is softer than high-pressure washing, is also an option.</p><br><p>Let\'s compare and contrast gentle wash and pressure washing to determine which the best solution is for you.</p>', NULL, 'Adelaide', 2, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-05-24 17:04:05'),
(412, 57, 7, 'Left Image Content', 'DIY Pressure Washing Facts', 'diy-pressure-washing-facts', NULL, '397', NULL, '<p>One of the benefits of pressure washing is the ease with which you may rent or buy a machine; having one of your own could make cleaning the driveway or exterior a breeze. Additionally, some people enjoy the convenience of being able to use a pressure washer whenever they need it without having to assemble a team.<br></p><p><br></p><p>But most of the time DIY cleaning is a risk for you because you have no proper knowledge about how to use your high-pressure washing that\'s why they are facing several disadvantages to using a pressure washer on your exterior surfaces. One is that its hit\'s psi can be difficult for someone unprepared, resulting in injury to himself or others and also the potential to harm surfaces.<br></p>', NULL, 'Adelaide', 6, '#ffffff', 'Yes', '2022-01-30 20:12:49', '2022-05-24 17:04:05');
INSERT INTO `term_custom_fields` (`id`, `content_term_id`, `content_term_parent_id`, `content_type`, `content_title`, `content_seo_url`, `content_sub_title`, `content_image`, `content_page_banner`, `content_details`, `content_short_details`, `content_zone`, `sorting_order`, `bg_color`, `is_active`, `created_at`, `updated_at`) VALUES
(413, 57, 7, 'Right Image Content', 'Besides our regular high-pressure cleaning in Adelaide, we provide the following services as well for an extra charge:', 'besides-our-regular-high-pressure-cleaning-in-adelaide-we-provide-the-following-services-as-well-for-an-extra-charge', NULL, '407', NULL, '<p><strong>Resanding Pavers Joint:</strong></p><p>The joint sand can be kept from washing away by sealing the paver surface. Sealing your pavers restores their original brilliance. The paver sealer also works as an adhesive between the sand particles in the joints, preventing them from washing away during rain or pressure washing.</p><p><strong>Roof Cleaning:</strong><br>Roof cleaning with a soft washing approach is a cost-effective and efficient way to keep your property clean. The roof must always be in excellent condition. You must ensure that the roof is well-maintained and that it is kept clean. We charge a premium for this service.<br></p>', NULL, 'Adelaide', 12, '#ffffff', 'Yes', '2022-01-31 20:17:01', '2022-05-24 17:04:05'),
(414, 57, 7, 'Right Image Content Without Title', 'Exterior window cleaning:', 'exterior-window-cleaning', NULL, '408', NULL, '<p><strong>Exterior Window Cleaning:</strong></p><p>Our friendly, uniformed technicians are ready and able to clean both the outside and inside of your windows and they’ll do it so well you’ll wonder where your windows have gone! For this work, we charge extra.</p><p><strong><br></strong></p><p><strong>Solar Panel &amp; Skylights Cleaning:</strong></p><p>We charge extra for Cleaning solar panels and skylights, however, you may wish to hire a professional solar panel cleaner to safeguard your safety and receive the best results for your system. The increased efficiency that thorough cleaning of solar panels may bring &amp; observed significant increases in solar efficiency of up to 30%.</p><p><br></p><p><br></p>', NULL, 'Adelaide', 14, '#ffffff', 'Yes', '2022-01-31 20:20:33', '2022-05-24 17:04:05'),
(415, 57, 7, 'Left Image Content Without Title', 'House Soft Washing:', 'house-soft-washing', NULL, '409', NULL, '<p><strong>House Soft Washing:</strong><br>Mold, algae, mildew, grime, and other pollutants can be removed from a surface with soft washing. The less expensive alternative necessitates less effort and setup time.<br>There\'s no need for scaffolding or ladders. We utilize the best \"soft wash procedure\" to clean your property. This method not only refreshes the appearance of your home but also protects and preserves the surfaces and plant life. <br><strong>Fence Cleaning:</strong><br>Putting up a fence is a great way to keep animals and intruders out. It also helps to restrict mobility and access to your facility. Above all, it has the potential to increase your curb appeal. But it doesn\'t stop there. If you don\'t maintain your fence, it will eventually lose its allure. Over time, dirt, mildew, oil, and other filthy substances stick to fences, making them less appealing. This is why it\'s so important to keep your fence in good shape.</p><br>', NULL, 'Adelaide', 13, '#ffffff', 'Yes', '2022-01-31 20:30:15', '2022-05-24 17:04:05'),
(416, 57, 7, 'Right Image Content', 'Benefits of professional High-pressure cleaning', 'benefits-of-professional-high-pressure-cleaning', NULL, '392', NULL, '<p><br></p><p>First impressions are really important.&nbsp; So don\'t let your property\'s dirty siding, dusty surfaces, or algae-covered pavement scare away a potential buyer. To sell your property, you\'ll need more than simply a \"For Sale\" sign in the yard. If you didn\'t know, hiring a high-pressure cleaner before listing your home on the market will help you sell it faster while also improving the value by 5 to 10%. <br></p><p>You may ensure that your property stands out among similarly priced residences by keeping the exterior clean and tidy. </p>', NULL, 'Adelaide', 5, '#ffffff', 'Yes', '2022-01-31 20:34:40', '2022-05-24 17:04:05');
