"List Table 4 Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"></w:LsdException>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin-top:0in;\r\n	mso-para-margin-right:0in;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0in;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--><p>Pressure washing is a technique for removing contaminants from a surface by spraying it with highly pressurized water. Pressure washers\' strength is measured in pounds per square inch (PSI).</p><p>Pressure washing has a significant disadvantage when done incorrectly. It has the potential to harm surfaces. The surface of a deck, for example, might be badly destroyed if high-powered pressure is applied. Because wood is softer than concrete, it requires a different PSI.</p><p>To wash concrete, pavement, and other dirty hard surfaces; to remove loose paint or stain from wooden or aluminum siding; to prepare a deck for staining (for example, when removing old wood fibers and loose paint from the deck); to remove loose paint or stain from wooden or aluminum siding.</p><br>', NULL, 'Adelaide', 8, '#ffffff', 'Yes', '2022-01-31 20:50:03', '2022-05-24 17:04:05'),
(418, 57, 7, 'Right Image Content', 'How do we do the High-pressure cleaning process?', 'how-do-we-do-the-high-pressure-cleaning-process', NULL, '410', NULL, 'The aim is to apply the solution and let it sit long enough to loosen up the mildew or soiling when our high-pressure cleaning team hits it with pressure or hot water. Because pressure takes precedence over solution concentration, pressure cleaning can begin as soon as 5 minutes after the solution is applied.<p>Use the solution with Oz cleaner professional-grade surfactant to improve the cleaning process and eradicate any mildew spores that may be present (which contains wetting agents to keep the solution wet longer).</p><p>Oz cleaner professional high-pressure cleaning has access to chemicals in large quantities that ordinary individuals would not be able to obtain at their local hardware store. This changes the game dramatically because they can now control the concentrations sprayed and where they are sprayed. All in one day on the truck (for example, a higher concentration for the roof and a lesser concentration for the vinyl siding.</p>', NULL, 'Adelaide', 11, '#ffffff', 'Yes', '2022-01-31 21:00:28', '2022-05-24 17:04:05'),
(419, 57, 7, 'Left Image Content', 'High Pressure Cleaning - Satisfaction guarantee:', 'high-pressure-cleaning---satisfaction-guarantee', NULL, '412', NULL, '<p>Customer satisfaction is our objective, and we strive to go above and above every time. It motivates our professionals and businesses to provide high-quality services.</p><p><br></p><ul><li>If you are not completely pleased with the results, we will redo the task. If you are still displeased with the work, you do not have to pay for it.</li><li>To claim a guarantee, you need to email us within 7 calendar days with \r\nthe exit report and the agent\'s details. Any complaint will only be \r\naccepted in writing by email with photos.</li><li>In the case of any cleaning complaint, we require either the customer or\r\n the property manager to check the work. While our cleaners are still \r\npresent on the property, please make sure complaints have been fixed to \r\nthe standard you want.</li></ul><p><br></p><p>We want to keep you as a long-term customer, therefore we\'re committed to giving you the finest possible service!<br><br></p>', NULL, 'Adelaide', 16, '#ffffff', 'Yes', '2022-02-01 16:22:54', '2022-05-24 17:04:05'),
(420, 57, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 10, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-05-24 17:04:05');
