(421, 57, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 15, '#ffffff', NULL, '2022-02-11 18:42:46', '2022-05-24 17:04:05'),
(422, 38, 7, 'Bullets Vertical', 'Some important things you should know before booking our once-off cleaning service.', '-some-important-things-you-should-know-before-booking-our-once-off-cleaning-service', NULL, '363', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 17, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-05-17 12:52:25'),
(423, 38, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 5, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-05-16 17:37:33'),
(424, 38, 7, 'Side by Side Bullets', 'Spring cleaning service inclusion:', 'spring-cleaning-service-inclusion', NULL, NULL, NULL, '<p class=\"MsoNoSpacing\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:13.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#111111;letter-spacing:-.15pt;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm\" lang=\"EN-IN\">A general End of Lease Cleaning requires the property to be empty. However, for a spring cleaning, the property would be furnished. If there are items in the cupboards, we will clean around them or charge extra to remove them before cleaning.<br><br><br><br><o:p></o:p></span></p>', 'For following service we charge extra in our end of lease cleaning services', 'Adelaide', 2, '#ffffff', NULL, '2021-10-22 11:08:23', '2022-05-16 17:37:33'),
(425, 38, 7, 'Term Title', 'Spring <span>Cleaning</span>', 'spring-spancleaningspan', NULL, '86', 355, '<p><span style=\"font-size: 1rem;\"><span style=\"font-size: 13.5pt; font-family: lucida, &quot;serif&quot;;\" lang=\"EN-AU\">We are<strong> OZ CLEANERS!!!</strong></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><font face=\"lucida, serif\"><span style=\"font-size: 18px;\">Who doesn\'t want spare time to spend with their beloved family in a clean and healthy place? In our once-off, pre-inspection, or spring cleaning there is no limit to what we do.</span></font></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\">Oz cleaner guarantees the highest level of cleaning satisfaction and quality assurance.<span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial;color:#0E101A\"></span>\r\n\r\n</p>', NULL, 'Adelaide', 0, '#ffffff', 'Yes', '2022-01-19 18:19:32', '2022-05-17 17:41:18'),
(426, 38, 7, 'Why Choose Us', 'Why choose us', 'why-choose-us', NULL, '50', NULL, '<p>Services we provide</p>', NULL, 'Adelaide', 4, '#f5f5f5', 'Yes', '2022-01-23 10:25:14', '2022-05-16 17:37:33'),
(427, 38, 7, 'Right Image Content', 'Pre-inspection, Once off, or Spring cleaning services <span>In Adelaide</span>', 'pre-inspection-once-off-or-spring-cleaning-services-spanin-adelaidespan', 'Spring cleaning is the perfect time for a fresh and clean environment to add to your house!', '335', NULL, '<p>When the weather starts to warm up, this is a sign to bust open your windows and, less exciting, you’re cleaning supplies cabinet. And as much as we appreciate the concept of spring cleaning, it is advised to tidy up year-round to prevent the deepest of deep cleans.</p><p>Not sure where to start your spring cleaning (or just once off deep cleaning in summer, fall, or winter) project? Use this to-do list, which includes all the spots you have most likely been neglecting all these days.</p>', NULL, 'Adelaide', 1, '#ffffff', 'Yes', '2022-01-23 20:44:47', '2022-05-17 17:27:47'),
(428, 38, 7, 'Left Image Content Without Title', 'oven cleaning', 'oven-cleaning', NULL, '361', NULL, '<br><p><strong>BBQ Cleaning:</strong></p><p>It\'s time to get your grill ready for another season of outdoor cookouts, burgers, and barbeque as summer approaches. The first step is to thoroughly clean the grill of any leftovers from last summer\'s cooking experiences.</p><p>Our crews are skilled at cleaning all types of BBQs so they can reclaim their former glory.</p><br>', NULL, 'Adelaide', 13, '#000000', 'Yes', '2022-01-23 21:01:21', '2022-05-17 12:22:31'),
(429, 38, 7, 'Left Image Content Without Title', 'Exit Cleaning is an <span>Art</span>', 'exit-cleaning-is-an-spanartspan', NULL, '336', NULL, '<p>Completing the above checklist will help you to get past your home inspection (pre-inspection cleaning) by the real estate agent in one go. However, cleaning something is not a pleasant job for all, or everyone doesn’t know what to clean and how to clean to live a sparkling healthy life.</p><br><p>If you find the once-off, pre-inspection, or spring cleaning too hard for you, complicated, or you don’t have enough time, you can count on the expert of Oz Cleaners to do the job for you gladly.</p><p>Even, if you want us to do something not listed here, our team is ready to do it for you for an extra cost, either hourly or based on the checklist you provided.</p><br>', NULL, 'Adelaide', 3, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-05-16 17:37:33'),
(430, 38, 7, 'Left Image Content Without Title', 'carpet cleaning', 'carpet-cleaning', NULL, '357', NULL, '<p><strong>Carpet cleaning:</strong></p><p>Because hardly every property has carpets, it is considered an extra service. If carpet cleaning is required as part of our standard spring cleaning service, we employ a carpet shampooing machine.</p><p>If you prefer carpet steam cleaning, please book it separately or talk to our friendly staff about it. We will send a different team to do the carpet steam cleaning only.</p><p><strong>Blinds cleaning:</strong><br>There are many kinds of blinds, and some appear to be quite simple to clean yet require far more effort than you may expect. As a result, we charge an additional fee for standard blind cleaning.<br>Please note that we do not clean curtains, but you can get an estimate by clicking this link.<br></p>', NULL, 'Adelaide', 7, '#ffffff', 'Yes', '2022-01-30 20:12:49', '2022-05-17 11:28:37'),
(431, 38, 7, 'Right Image Content', 'To provide the following service we charge extra in our spring cleaning or once off cleaning service Adelaide:', 'to-provide-the-following-service-we-charge-extra-in-our-spring-cleaning-or-once-off-cleaning-service-adelaide', NULL, '344', NULL, '<p><strong>Exterior window cleaning:</strong></p><p>The Exterior window cleaning situation is mostly unpredictable without looking at it. Since we do not visit your property before confirming the job, we rely on your provided information to give you a quote. With many details you provide us, the quote will be more accurate.</p><p>Sometimes, flyscreens get damaged when a non-technical person tries to open them or re-install them. So, we ask you to keep it open for our cleaning team to avoid any future trouble. If not, then we will skip those window panes with flyscreen.</p><br>', NULL, 'Adelaide', 6, '#ffffff', 'Yes', '2022-01-31 20:17:01', '2022-05-24 17:01:45');
