lse\" Priority=\"47\" Name=\"List Table 2 Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"></w:LsdException>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin-top:0in;\r\n	mso-para-margin-right:0in;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0in;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-ansi-language:EN-IN;\r\n	mso-fareast-language:EN-IN;}\r\n</style>\r\n<![endif]--><p>Most people believe it belongs on the general spring cleaning list, but we all know that this is the most difficult portion of the job. The pricing we provide you over the phone or in our system is a rough estimate.</p><p>We will determine the exact cost after discussing it with you when our team arrives on-site, based on the state of the walls.</p><p><strong><br></strong></p><p><strong>Garage cleaning:</strong></p><p>We sweep and vacuum the floor, remove cobwebs, dust the walls, and clean the skirting boards exclusively during garage cleaning.</p>', NULL, 'Adelaide', 8, '#ffffff', 'Yes', '2022-01-31 20:30:15', '2022-05-16 17:37:33'),
(434, 38, 7, 'Left Image Content Without Title', 'Balcony cleaning:', 'balcony-cleaning', NULL, '358', NULL, '<p><strong>Balcony cleaning:</strong></p><p>We do not scrub the balcony but sweep, vacuum, and mop. Also, clean the outside glasses of the sliding doors when the balcony is considered an extra service.</p><p>&nbsp;<br></p><p><strong>Air-conditioner vent cleaning:</strong><br></p><p>We can only\r\n provide an estimate for this if our staff is on-site and capable of \r\nperforming it, as it is an essential task. The fee is determined after a\r\n discussion of the problems and cleaning requirements.</p><p><br></p>', NULL, 'Adelaide', 10, '#ffffff', 'Yes', '2022-01-31 20:34:40', '2022-05-17 11:40:34'),
(435, 38, 7, 'Right Image Content Without Title', 'Fridge cleaning:', 'fridge-cleaning', NULL, '359', NULL, '<p><strong>Fridge cleaning:</strong></p><p>It is an extra item in our spring cleaning service because only a few clients want it cleaned. When people stay at home, the fridge won\'t be empty and make the job hard. So, we charge extra for this.</p><p><strong>Oven Cleaning:</strong></p><p>Cleaning the oven is a duty \r\nthat we all know needs to be done, but none of us like to do it. It\'s a \r\npainstaking process that takes time and necessitates the use of strong \r\nchemicals to remove all of the filth.</p><p>Hiring professionals to \r\nclean your oven is a wonderful idea since it ensures that the job is \r\ndone correctly, saving you time and money in the long run.</p><br><br>', NULL, 'Adelaide', 11, '#ffffff', 'Yes', '2022-01-31 20:50:03', '2022-05-17 12:06:36'),
(437, 38, 7, 'Right Image Content', 'Things we don\'t do as standard in spring cleaning services:', 'things-we-dont-do-as-standard-in-spring-cleaning-services', NULL, '349', NULL, '<ul><li>Lifting heavy items and furniture to clean underneath</li><li>Areas not accessible - such as ceilings, higher windows</li><li>Cleaning inside appliances – such as washing machine</li><li>Light fittings attached to the ceiling – chances of damage</li><li>Fabric blinds or curtains – chances to get damaged</li></ul>', NULL, 'Adelaide', 14, '#ffffff', 'Yes', '2022-02-01 16:22:54', '2022-05-17 12:23:18'),
(438, 38, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 9, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-05-16 17:37:33');
INSERT INTO `term_custom_fields` (`id`, `content_term_id`, `content_term_parent_id`, `content_type`, `content_title`, `content_seo_url`, `content_sub_title`, `content_image`, `content_page_banner`, `content_details`, `content_short_details`, `content_zone`, `sorting_order`, `bg_color`, `is_active`, `created_at`, `updated_at`) VALUES
(439, 38, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 12, '#ffffff', NULL, '2022-02-11 18:42:46', '2022-05-16 17:37:33'),
(440, 39, 7, 'Bullets Vertical', 'Some very important things you should know before booking our regular house cleaning services:', 'some-very-important-things-you-should-know-before-booking-our-regular-house-cleaning-services', NULL, '322', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 17, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-05-16 11:35:55'),
(441, 39, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 7, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-05-16 09:54:11'),
(442, 39, 7, 'Side by Side Bullets', 'Regular house cleaning service inclusion', '-regular-house-cleaning-service-inclusion', NULL, NULL, NULL, '<p class=\"MsoNoSpacing\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:13.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#111111;letter-spacing:-.15pt;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm\" lang=\"EN-IN\">A general Regular house cleaning requires the property to be empty. However, for a Regular house cleaning of course property would be furnished we know that. If there are items in the cupboards we will clean around them or we may charge extra to remove them before cleaning. We will not be responsible for moving heavy items from the floor, in order for the space to be cleaned.<o:p></o:p></span></p>', 'For following service we charge extra in our end of lease cleaning services', 'Adelaide', 8, '#ffffff', NULL, '2021-10-22 11:08:23', '2022-05-16 09:54:11'),
(443, 39, 7, 'Term Title', 'Regular House <span>Cleaning</span>', 'regular-house-spancleaningspan', NULL, '82', 328, '<p>We are OZ CLEANERS!!!</p><p>When you employ oz cleaner to clean your house, you are getting the most comprehensive and expert cleaning services in Adelaide! Each regular cleaning service begins with a deep clean, allowing us to bring each property back to life. <br></p><p>We\'ve had customers for years, and they now consider us family because we understand their situation and love to help. You are going to be the next. We are available 7 days a week, at your convenience.</p><br>', NULL, 'Adelaide', 0, '#ffffff', 'Yes', '2022-01-19 18:19:32', '2022-05-16 12:48:54'),
(444, 39, 7, 'Why Choose Us', 'Why choose us', 'why-choose-us', NULL, '50', NULL, '<p>Services we provide</p>', NULL, 'Adelaide', 6, '#f5f5f5', 'Yes', '2022-01-23 10:25:14', '2022-05-16 09:54:11'),
(445, 39, 7, 'Right Image Content', 'Regular House Cleaning<span> In Adelaide</span>', 'regular-house-cleaningspan-in-adelaidespan', 'Always ready to help, wherever and whenever you need in Adelaide!', '305', NULL, '<p>We fit our time with yours to make you some time to spend with your beloved family after all day’s hard work. <br></p><p>After all, you are not a machine!</p><p><br></p><p>Leave your daily mess to us, we will take care of it for a very minimal cost and will gift you a clean, healthy, and relaxed life.<br></p><br>', NULL, 'Adelaide', 1, '#ffffff', 'Yes', '2022-01-23 20:44:47', '2022-05-16 09:54:11'),
(446, 39, 7, 'Right Image Content', 'How to get the best price when buying a regular house cleaning service?', '-how-to-get-the-best-price-when-buying-a-regular-house-cleaning-service', NULL, '313', NULL, '<p>House cleaning services are usually charged by the hour and rates vary from $40 to $60 per hour. On average, a house takes 2 to 4 hours to thoroughly clean, but the time can vary based on what you want. If your house is relatively clean or you only want a limited number of services, it will take less time. If one or more rooms need a more thorough cleaning, it may take longer.</p><p>There are some companies in the market that offers a price per visitor based on the size of your property as well. They will ask for your property details first, calculate how many hours it may take, and then they will give you the quote. End of the story, they are also charging you on an hourly basis.</p><p>So, to choose the best one, provide your property details and requirement to the company. Either a smart system like Oz Cleaners or someone will call you to give a price. But always remember to get one piece of information, what is the maximum time they will clean your house by that price.</p>', NULL, 'Adelaide', 5, '#000000', 'Yes', '2022-01-23 21:01:21', '2022-05-16 10:13:14'),
(447, 39, 7, 'Left Image Content', 'Regular house cleaning services protect your mental health <span></span>', 'regular-house-cleaning-services-protect-your-mental-health-spanspan', NULL, '310', NULL, '<p>Buying a regular house cleaning service gives you some time to breathe from your busy life and to live you have to breathe right! We earn money to live like a human, not like a machine. But sometimes we forget and try to do everything by ourselves instead of taking others\' help to save some money.</p>&nbsp;<br><p>Have you ever asked yourself, if everyone starts thinking like that then you won\'t have had a job as well? Leave it, we are not trying to sell our regular house cleaning service to you though that\'s an indirect reason as well for saying all this. All we want to imply here is, keep some time for \'you\' can protect your mental health and can give you a happy life.</p>&nbsp; &nbsp;<br><p><br></p>', NULL, 'Adelaide', 2, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-05-16 09:55:03'),
(448, 39, 7, 'Left Image Content Without Title', 'How to choose the best house cleaning service provider?', 'how-to-choose-the-best-house-cleaning-service-provider', NULL, '309', NULL, '<p>According to us look for these 3 key points before hiring any house cleaning service provider:</p><ul><li>&nbsp; Is the company or cleaner insured or not. This is very important, you will get compensated if anything is damaged by the cleaner while working.</li><li>&nbsp; What other customers are saying about the company you want to hire. The easiest way to find out this is to look for their reviews on google.</li><li>&nbsp;Cleaner’s background checked or not. A good company will provide the cleaner’s police check and photo ID if you required it.</li></ul><p><br></p>', NULL, 'Adelaide', 4, '#ffffff', 'Yes', '2022-01-30 20:12:49', '2022-05-16 10:05:16'),
(449, 39, 7, 'Right Image Content', 'To provide the following service we charge extra in our Regular house cleaning services', 'to-provide-the-following-service-we-charge-extra-in-our-regular-house-cleaning-services', NULL, '317', NULL, '<p><strong>Windows outside cleaning:</strong></p><p>Like interior window cleaning, we can’t predict how big the windows are or how many panes are there without visiting the property. We only assume a price based on the property details you provided in our system. When our team would be there, the price may increase based on their inspection. Usually, they look for high exterior windows, difficulties opening fly-screens, etc to clean it properly. </p><p>There is a higher chance of damage if we open and re-install fly screens after cleaning. That’s why we want our client to open the fly screens and re-install them after cleaning if fly screens need to clean. But in our window cleaning services, our team opens and re-installs fly-screens after cleaning since they are experts on it.</p><br><br><br>', NULL, 'Adelaide', 10, '#ffffff', 'Yes', '2022-01-31 20:17:01', '2022-05-16 11:02:34'),
(450, 39, 7, 'Left Image Content Without Title', 'carpet cleaning', 'carpet-cleaning', NULL, '320', NULL, '<p><strong>Carpet cleaning:</strong> <br></p><p>In our Regular house \r\ncleaning services, carpet steam cleaning is an extra service since every\r\n property doesn’t have a carpet. In our regular house cleaning services \r\nwe use a carpet shampooing machine like others so cannot guarantee any \r\nstain removals. If you want the carpet cleaning at the highest level \r\nthen book carpet steam cleaning separately with us. Because then we will\r\n send our carpet cleaning specialist only to clean your carpet at that \r\ntime.</p><br><p>&nbsp;<strong>Oven cleaning:</strong> An oven is a very \r\ncommon feature in any residential property but we can’t predict how \r\ndirty it is. If it requires wiping with a wet cloth only then oven \r\ncleaning is free in our regular house cleaning. We charge extra for oven\r\n cleaning if it requires special attention and extra time. </p><p>That’s why we ask our clients to keep the fly-screens removed before we start and re-install when we finish. Or else, we will avoid those glasses.</p>', NULL, 'Adelaide', 11, '#ffffff', 'Yes', '2022-01-31 20:20:33', '2022-05-16 11:24:21'),
(451, 39, 7, 'Right Image Content Without Title', 'BBQ coocker cleaning', 'bbq-coocker-cleaning', NULL, '321', NULL, '<p><strong>BBQ cooker cleaning:</strong> <br></p><p>This is a very \r\nuncommon thing we use to get in our regular house cleaning services. If \r\nyou have a BBQ cooker from the landlord and need to clean it before \r\nleaving then we will charge extra for that. There is a standard price \r\nfor BBQ cooker cleaning in our online quote system. Select this while \r\nbooking your regular house cleaning service in our system.</p><br><p><strong>High-pressure cleaning:</strong></p><p>Pressure\r\n washing removes mold and mildew, which are damaging to both your home \r\nand the health of your family. When mildew and mold go unchecked, they \r\ncontinue to grow -- and mold can grow within walls, meaning your home\'s \r\ninterior could be affected. Oz Cleaners has an expert team to do \r\nhigh-pressure cleaning and property soft-washing for you as well.</p><br>&nbsp;<br>&nbsp;', NULL, 'Adelaide', 12, '#ffffff', 'Yes', '2022-01-31 20:30:15', '2022-05-16 11:31:39'),
(452, 39, 7, 'Left Image Content', 'Regular House Cleaning - satisfaction guarantee', 'regular-house-cleaning---satisfaction-guarantee-', NULL, '284', NULL, '<p>&nbsp; A satisfaction guarantee means we return free of charge to your property to rectify any issues you got after we left. Issues have to be related to cleaning provided by us and they are on our standard checklist.</p><ul><li>To claim this guarantee you need to email us within 72 hours (not including weekends or public holidays) with the exit report and the agent\'s details. We accept re-clean issues in writing only (email) with issued images and comments.</li><li>No exceptions to the 72-hour condition unless discussed with us by email (in writing) before the cleaning has taken place.</li><li>In case of any cleaning complaints, you have to provide a notice of at least 48 hours to fix the cleaning complaint. We do our best to rectify any cleaning issues as soon as possible but 48 hours is our least time to return your property.</li><li>We require you to check the work while our cleaners are still present on the property. The reason is we want you to make sure the issues are rectified to your standard. We will not come back a second time for any new issue or the same issue to rectify.</li></ul><br><br>', NULL, 'Adelaide', 14, '#ffffff', 'Yes', '2022-01-31 20:34:40', '2022-05-16 10:18:22'),
(456, 39, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 9, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-05-16 09:54:11'),
(457, 39, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 13, '#ffffff', NULL, '2022-02-11 18:42:46', '2022-05-16 09:54:11'),
(458, 59, 7, 'Bullets Vertical', 'Know before booking our end of lease cleaning services:', 'know-before-booking-our-end-of-lease-cleaning-services', NULL, '136', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 16, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-05-24 16:10:23'),
(459, 59, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 3, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-05-24 16:10:23'),
(461, 59, 7, 'Term Title', 'Gutter <span>Cleaning</span>', 'gutter-spancleaningspan', NULL, '194', 476, '<p><span style=\"font-size: 1rem;\"><span style=\"font-size: 13.5pt; font-family: lucida, &quot;serif&quot;;\" lang=\"EN-AU\">We are<strong> OZ CLEANERS!!!</strong></span></span></p><p>Gutters are meant to protect your home from water damage both inside and out. If you don\'t clean your gutters regularly, water will repost, damage your roof, and seep into your home.</p><p>Oz cleaner offers high-quality professional gutter cleaning and repairing services for homes In Adelaide and uses the best equipment. </p>', NULL, 'Adelaide', 0, '#ffffff', 'Yes', '2022-01-19 18:19:32', '2022-05-24 16:10:23'),
(462, 59, 7, 'Why Choose Us', 'Why choose us', 'why-choose-us', NULL, '50', NULL, '<p>Services we provide</p>', NULL, 'Adelaide', 7, '#f5f5f5', 'Yes', '2022-01-23 10:25:14', '2022-05-24 16:10:23'),
(463, 59, 7, 'Right Image Content', 'Gutter Cleaning <span>In Adelaide</span>', 'gutter-cleaning-spanin-adelaidespan', 'We work tirelessly to improve the safety and comfort of you and your family by cleaning.', '103', NULL, '<p>Gutters, like the roofing system, are an important aspect of a house\'s overall health. Gutters are essential for keeping water out of your home. Guttering not only gives a home a finished aspect, but also channels and controls rainwater, protecting the roof, walls, and landscaping. The best gutter cleaning services in Adelaide are required for gutter cleaning. Install a gutter system on every new home because its function of guiding rain and drainage off the roof and away from the foundation is critical to the structure\'s structural integrity. If you\'re interested in knowing more, go to <a href=\"https://www.guttercleaningmachines.com/gutter-cleaning-tools/\">gutter benefit</a>.&nbsp; <br></p>', NULL, 'Adelaide', 1, '#ffffff', 'Yes', '2022-01-23 20:44:47', '2022-05-24 16:10:23'),
(464, 59, 7, 'Left Image Content', 'why choose professional gutter cleaner not DIY?', 'why-choose-professional-gutter-cleaner-not-diy-', NULL, '108', NULL, '<p>One of the reasons you should choose professional gutter cleaning services rather than doing it yourself is that they have better technology. Most professionals can readily handle minor concerns like bracket replacement, caulking, and slope modifications if your gutters need to be repaired.</p><p>Gutter cleaning nearly always necessitates the use of long ladders and maneuvering at great heights. Inexperienced homeowners are more likely to fall, which can lead to serious injuries or even death. Professional gutter cleaning is simply faster and less expensive in the long run, regardless of how you look at it.</p><p>You can ensure that your gutters are cleaned correctly the first time by hiring a professional.</p><p>We don\'t say you take oz cleaner gutter cleaning service but twice a year gutter cleaning is most important for your roof curb and your family\'s health. <br> </p>', NULL, 'Adelaide', 5, '#000000', 'Yes', '2022-01-23 21:01:21', '2022-05-24 16:17:20'),
(465, 59, 7, 'Left Image Content', 'Why need gutter cleaning? <span></span>', 'why-need-gutter-cleaning-spanspan', NULL, '107', NULL, '<p>Many individuals ignore their gutters when it comes to home maintenance. Gutter clogging is caused by dust and debris in rainwater, as well as falling leaves from nearby trees. They must be clean of dirt and debris to perform effectively. When the gutter is kept clean and clear of debris, the structural integrity of the home is often preserved. Clogged gutters can pose major issues and jeopardize the property\'s general integrity. </p><br><p>Rainwater overflows due to clogged gutters that obstruct the proper flow of water. Water damage to both the interior and exterior of your property can occur when gutters overflow. Debris collection in gutters provides a breeding ground for pests, rodents, and disease-causing organisms. Gutters gather rainwater and redirect it away from the foundation and other important parts of the house. Clogged gutters detract from the visual appeal of your property and reduce the total value of a home that you plan to sell.</p><br><p>One of the most critical continuing maintenance jobs for your property is keeping your gutters clean. Fortunately, there are several professional-grade cleaning methods available. You can get into difficulty if you try to do everything yourself all of the time. This necessitates the use of gutter cleaning services.</p><br>', NULL, 'Adelaide', 2, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-05-24 16:10:23'),
(466, 59, 7, 'Right Image Content', 'Benefits of Gutter Cleaning', 'benefits-of-gutter-cleaning', NULL, '104', NULL, '<ul><li>If debris clogs your gutters, water may pool around your foundation, causing damage. A leaking roof can damage your home\'s walls, ceilings, floors, fascia boards, and other components.&nbsp; Regular gutter cleaning helps to protect your home from water damage.</li><li>Gutter clogs retain moisture, ice, and debris, making them heavy and sagging. Gutter cleaning is a crucial part of keeping your roof and home in good shape and Extending your roof life.</li><li>Birds, rodents, mice, insects, and mosquitoes are attracted to leaves, twigs, and other waste deposited in gutters. Clogs can occur when these creatures build nests in your gutters. Animals avoid your gutter as a result of gutter cleaning. <br></li><li>Gutter cleaning enhances the safety, health, and comfort of your family and employees by eliminating bacteria, contaminants, and pests that carry diseases.</li><li>Gutters help direct water away from your landscaping. <br></li><li>Gutters that are clogged are ineffective in draining water from your roof. Water may collect on your roof as a result of this. Water might leak into your home if it pools on your roof. Overflowing gutters can cause roof leaks, which can be avoided with gutter maintenance performed by a gutter cleaning company. <br></li></ul>', NULL, 'Adelaide', 4, '#ffffff', 'Yes', '2022-01-30 20:12:49', '2022-05-24 16:10:23'),
(467, 59, 7, 'Left Image Content', 'To provide the following service we charge extra in our gutter cleaning service Adelaide:', 'to-provide-the-following-service-we-charge-extra-in-our-gutter-cleaning-service-adelaide', NULL, '127', NULL, '<p><strong>Exterior Window Cleaning:</strong></p><p>Our friendly, \r\nuniformed technicians are ready and able to clean both the outside and \r\ninside of your windows and they’ll do it so well you’ll wonder where \r\nyour windows have gone! For this work, we charge extra.</p><p><strong><br></strong></p><p><strong>Solar Panel &amp; Skylights Cleaning:</strong></p><p>We\r\n charge extra for Cleaning solar panels and skylights, however, you may \r\nwish to hire a professional solar panel cleaner to safeguard your safety\r\n and receive the best results for your system. The increased efficiency \r\nthat thorough cleaning of solar panels may bring &amp; observed \r\nsignificant increases in solar efficiency of up to 30%.</p><p><br></p><p><br><br></p>', NULL, 'Adelaide', 10, '#ffffff', 'Yes', '2022-01-31 20:17:01', '2022-05-24 17:09:27'),
(468, 59, 7, 'Right Image Content', 'Our cleaning process', 'our-cleaning-process', NULL, '129', NULL, '<p>Oz cleaner provides Professional gutter cleaning services in Adelaide. Our cutting-edge technology and highly trained crew will eliminate the stress of gutter cleaning by doing the job safely and swiftly in just one visit. Professional gutter cleaners will, on average, clean your gutters more thoroughly and effectively than you could. To blast clogs out, use vacuums with gutter-sized attachments or highly powerful power washers. They clean up the trash, prevent mold, leaks, and ice dams, and inspect your downspouts at the same time.<br>Gutter cleaning scoops are quite effective, but they necessitate repositioning the ladder every 4 to 5 feet. A dirty gutter may be cleaned quickly with pressure washer accessories. To clean high gutters using a ladder, first, ensure the ladder is stable, then clear the gutter by hand in a methodical manner. Our professionals can clear blockages without climbing up to the roof by using the right gear, and if they need to perform a closer inspection, they\'ll use specially constructed ladders, harnesses, and other safety measures. To clean gutters from the ground, we use a wet/dry vacuum to construct a DIY gutter vacuum, then pass the gutter vacuum over the gutter to remove debris.<br>Using a leaf blower to clean your gutters eliminates the need to remove material by hand, just as it eliminates laborious raking on the ground. Climbing a ladder onto the roof and walking along the edge, blowing the leaves out of the gutter as we go, is the simplest technique. we use an extension kit as a safer option.<br><br><br></p>', NULL, 'Adelaide', 9, '#ffffff', 'Yes', '2022-01-31 20:20:33', '2022-05-24 17:10:29'),
(469, 59, 7, 'Left Image Content Without Title', 'Roof Cleaning:', 'roof-cleaning', NULL, '126', NULL, '<p><strong>Roof Cleaning:</strong><br>Roof cleaning with a soft washing \r\napproach is a cost-effective and efficient way to keep your property \r\nclean. The roof must always be in excellent condition. You must ensure \r\nthat the roof is well-maintained and that it is kept clean. We charge a \r\npremium for this service.</p>', NULL, 'Adelaide', 11, '#ffffff', 'Yes', '2022-01-31 20:30:15', '2022-05-24 17:11:22'),
(471, 59, 7, 'Left Image Content Without Title', 'Air-conditioner vent cleaning:', 'air-conditioner-vent-cleaning', NULL, '128', NULL, '<p><strong>Air-conditioner vent cleaning:</strong><br></p><p>We can quote for this only when our team is on-site, and they can do it since it can be a critical job. The price depends based on the difficulties and cleaning requirements upon discussion.</p><p><br></p><p><strong>Exterior house cleaning:</strong></p><p>This includes sweeping the outside area, removing cobwebs, and washing the whole house by hose pipe. No pressure washing is included in this service. If you need to remove any oil stains or something like that, please discuss it with our friendly team.<br></p>', NULL, 'Adelaide', 13, '#ffffff', 'Yes', '2022-01-31 20:50:03', '2022-05-24 16:10:23'),
(472, 59, 7, 'Right Image Content', 'Our clients pay extra for the following services:', '-our-clients-pay-extra-for-the-following-services', NULL, '133', NULL, '<p>The most crucial factor to consider when deciding on gutter cleaning \r\ncharges is that not all homes are made equal. Even if the gutters have \r\nthe same amount of linear footage, certain gutters in higher or more \r\ndifficult-to-reach spots may increase the overall cost of the cleaning.<br>There\r\n may be an additional price if there are overhanging trees that make it \r\ndifficult for a professional to travel around the exterior of the home \r\nwhile cleaning the gutters.</p>', NULL, 'Adelaide', 14, '#ffffff', 'Yes', '2022-01-31 21:00:28', '2022-05-24 17:15:35'),
(473, 59, 7, 'Left Image Content', 'End of lease cleaning - bond back guarantee:', 'end-of-lease-cleaning---bond-back-guarantee', NULL, '134', NULL, '<ul><li>Bond back guarantee means we return for free to rectify any issues your agent has from our checklist.</li><li>To claim a guarantee, you need to email us within 7 calendar days with the exit report and the agent\'s details. Any complaint will only be accepted in writing by email with photos.</li><li>In the case of any cleaning complaint, we require either the customer or the property manager to check the work. While our cleaners are still present on the property, please make sure complaints have been fixed to the standard you want.</li><li>With our unstoppable desire to grow the business, we can assure you, for one thing, you will never regret choosing us.</li></ul>', NULL, 'Adelaide', 15, '#ffffff', 'Yes', '2022-02-01 16:22:54', '2022-05-24 16:10:23'),
(474, 59, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 6, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-05-24 16:10:23'),
