(485, 61, 7, 'Left Image Content', 'Get the following benefits from our roof restoration services::', 'get-the-following-benefits-from-our-roof-restoration-services', NULL, '437', NULL, '<p><strong>Increases the roof\'s lifespan</strong></p><p>Roof coatings are applied during a roof restoration to help preserve it from the weather. Rain, snow, ice, sleet, hail storms, and scorching heatwaves are all common occurrences in Australia. They compromise the roof\'s structural integrity. If you are proactive and choose roof restoration before your roof declines beyond repair, you will be able to extend the life of your roof by several years. It just signifies that your roof will require some maintenance at some point. Failure to address current problems can exacerbate them in the future, resulting in significant out-of-pocket payments. If you choose to restore your roof, however, you can extend the life of your current roof for many more years. The cost of a roof restoration might easily double or triple the cost of a new home.</p><br>', NULL, 'Adelaide', 11, '#ffffff', 'Yes', '2022-01-31 20:17:01', '2022-05-21 16:05:26'),
(486, 61, 7, 'Left Image Content', 'Our Roof Restoration process', 'our-roof-restoration-process', NULL, '435', NULL, '<p>If you can\'t recall the last time you looked up at your roof and cleaned it, you should have it checked out. You can get help from Oz cleaner professional roof cleaning company. Oz cleaner has done an excellent job on this project. To achieve damage-free results, roof restoration demands experience and well-trained personnel which is available to us. Roof restoration experts at Oz cleaners are qualified to use various repair methods for specific regions of your roof. You might be wondering how a comprehensive roof restoration is completed. <br></p><p>Oz cleaner inspects your roof problems that may not be visible to the\r\n untrained eye. You might think your roof only has one or two cracks, \r\nbut there could be more that are affecting the integrity of your roof. </p><br>', NULL, 'Adelaide', 9, '#ffffff', 'Yes', '2022-01-31 20:20:33', '2022-05-21 17:32:18');
INSERT INTO `term_custom_fields` (`id`, `content_term_id`, `content_term_parent_id`, `content_type`, `content_title`, `content_seo_url`, `content_sub_title`, `content_image`, `content_page_banner`, `content_details`, `content_short_details`, `content_zone`, `sorting_order`, `bg_color`, `is_active`, `created_at`, `updated_at`) VALUES
(487, 61, 7, 'Right Image Content Without Title', 'restoration process', 'restoration-process', NULL, '436', NULL, '<p>The roof restoration process can begin once we have identified exactly \r\nwhat needs to be done. We will then go ahead and fix these issues. <br>The next step roof repair is \r\nused to replace any cracked or broken tiles, replace metal roofing \r\nsheets, or re-screwing materials. This is the most important part of the\r\n roof restoration process before any cleaning can begin. During the \r\ncleaning process, damaged points will become clearer as the dirt gets \r\nwashed off. Your roof will be neat and clean at this point, allowing our\r\n staff to re-bed it if necessary to guarantee that it is a watertight \r\nroof. We clean the roof to remove dirt and inspect it thoroughly before painting it, whether it\'s a tile roof restoration or a metal roof repair. &nbsp; <br></p><p>After finishing our roof restoration work then we inspect again \r\nand make sure everything is clean. This service will change depending on your roof. <br><br></p><p><br><br></p>', NULL, 'Adelaide', 10, '#ffffff', 'Yes', '2022-01-31 20:30:15', '2022-05-22 08:10:29'),
(488, 61, 7, 'Right Image Content Without Title', 'Improved Building Safety', 'improved-building-safety', NULL, '440', NULL, '<p><strong>Improved Building Safety</strong></p><p>Moisture builds up \r\nover time due to a small and seemingly insignificant leak in the roof. \r\nMoisture within a building can swiftly lead to mold growth, and moisture\r\n in wooden structures can lead to rot, which compromises a building\'s \r\nstructural integrity. A structurally deficient building puts not just \r\nyour home but also your family in jeopardy. If it\'s a commercial \r\nlocation, put your every employer\'s life on the line. As a result, your \r\nroof needs immediate restoration. </p><p><strong>Prevents leakage</strong></p><p>As your roof deteriorates \r\nover time, the likelihood that you are going to experience a leak is \r\ngoing to increase. If water is getting into your home, it will cause \r\nwater damage and the growth of mold and mildew. Unfortunately, a bucket \r\nis not going to fix your problems. By reinforcing all of the areas that \r\nleak on a typical roof, Oz cleaner makes it less likely to leak or need \r\nserious maintenance down the road. Simply put, after restoration, you \r\nhave a stronger and better roof than when it was new. Roof restoration \r\nproactively prevents leaks going forward.</p><p><strong><br></strong></p><br>', NULL, 'Adelaide', 12, '#ffffff', 'Yes', '2022-01-31 20:34:40', '2022-05-21 16:22:30'),
(489, 61, 7, 'Left Image Content Without Title', 'Save Money and Energy:', 'save-money-and-energy', NULL, '450', NULL, '<p><strong>Save Money and Energy:</strong></p><p>&nbsp;It is not possible to \r\nsell the house if your roof is in bad shape. It\'s allowing air out of \r\nyour house if that\'s the case. This causes your home to heat up more \r\nthan it needs to in the summer. It could be the cause of you having to \r\nturn up the air conditioner, which raises your electricity bill. In but \r\nwinter months decreased energy expenditure will subsidize the cost of a \r\nrestoration. Your roof’s new reflective surface not only protects it \r\nfrom the sun’s harsh rays but also reflects them away from the building.\r\n This, in turn, reduces the amount of heat your building absorbs, giving\r\n you a lower energy bill.</p><p><strong>Invest in a Roof Repair Instead of a Roof Replacement</strong></p><p>It will cost money to repair a leaking roof. Paying for roof restorations, on the other hand, will be significantly less expensive than replacing the roof entirely. A roof replacement may be your only option in some cases. However, whenever possible, you should choose restoration over replacement to save money.</p><br>', NULL, 'Adelaide', 13, '#ffffff', 'Yes', '2022-01-31 20:50:03', '2022-05-21 17:23:00'),
(490, 61, 7, 'Right Image Content Without Title', 'Tax Benefits:', 'tax-benefits', NULL, '441', NULL, '<p><strong>Tax Benefits:</strong></p><p>Government regulations impose tariffs \r\non new projects while exempting citizens from paying taxes on \r\nmaintenance work. You\'re always on the lookout for tax advantages and \r\ndeductions. Roof restoration, fortunately for you, falls under the \r\n\"maintenance\" area of company expenses, allowing you to claim a \r\nsignificant tax credit. It also isn\'t considered a depreciating asset. </p><p><strong><br></strong></p><p><strong>Roof Restoration Is the Environmentally Friendly Solution</strong></p><p>Rather\r\n than taking off old materials and dumping them in landfills, roof \r\nrestoration makes the most of the existing roof. Using environmental \r\nequipment and proper solutions for roof restoration.</p>', NULL, 'Adelaide', 15, '#ffffff', 'Yes', '2022-01-31 21:00:28', '2022-05-21 17:30:17'),
(491, 61, 7, 'Left Image Content', 'Roof Restoration - Satisfaction guarantee:', 'roof-restoration---satisfaction-guarantee', NULL, '447', NULL, '<ul><li>Our professional roofer has all types of equipment as well as a legitimate insurance policy. </li><li>To\r\n claim a guarantee, you need to email us within 7 calendar days with the\r\n exit report and the agent\'s details. Any complaint will only be \r\naccepted in writing by email with photos.</li><li>If you are not \r\ncompletely happy with the job we\'ve done, the roof restoration, or the \r\nattention to detail, we will return your money. Even if you believe I \r\ndidn\'t give it my all or acted in an unprofessional manner, I\'ll swiftly\r\n correct the matter to your satisfaction.</li><li>In\r\n the case of any cleaning complaint, we require either the customer or \r\nthe property manager to check the work. While our roofer is still \r\npresent on the property, please make sure complaints have been fixed to \r\nthe standard you want. </li></ul>', NULL, 'Adelaide', 16, '#ffffff', 'Yes', '2022-02-01 16:22:54', '2022-05-21 17:10:23'),
(492, 61, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 8, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-05-21 11:17:45'),
(493, 61, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 14, '#ffffff', NULL, '2022-02-11 18:42:46', '2022-05-21 11:17:45'),
(494, 73, 7, 'Bullets Vertical', 'Know before booking our soft washing services:', 'know-before-booking-our-soft-washing-services', NULL, '136', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 21, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-05-23 10:55:40'),
(495, 73, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 4, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-05-23 10:47:36');
