(548, 28, 8, 'Bullets Vertical', 'Know before booking our end of lease cleaning services:', 'know-before-booking-our-end-of-lease-cleaning-services', NULL, '136', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 18, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-02-11 18:45:02'),
