(584, 30, 8, 'Bullets Vertical', 'Some important things you should know before booking our tile and grout cleaning services:', 'some-important-things-you-should-know-before-booking-our-tile-and-grout-cleaning-services', NULL, '136', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 18, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-05-12 11:07:58'),
