(646, 12, 9, 'Right Image Content', 'We respect our clients', 'we-respect-our-clients', NULL, '104', NULL, '<p>We stand out from our competitors by providing the best after-sales service. We even hire other professionals for our clients, if there is something you need and we don\'t do.</p><p><br></p><p>For example, gardener, painter, handymen, etc. If you book with us and let us know you need those services then we will provide you our contact list for those jobs or contact for you with them.</p><p><br></p><p>We make moving out a less stressful affair for you with real estate agents by our professional exit cleaning services, and that\'s our promise.</p>', NULL, 'Adelaide', 5, '#ffffff', 'Yes', '2022-01-30 20:12:49', '2022-02-11 18:45:02'),
(647, 12, 9, 'Right Image Content', 'To provide the following service we charge extra in our end of lease cleaning service Adelaide:', 'to-provide-the-following-service-we-charge-extra-in-our-end-of-lease-cleaning-service-adelaide', NULL, '127', NULL, '<p><strong>Carpet steam cleaning:</strong></p><p>It is considered an extra service since every property doesn’t have carpets. In our regular end of lease cleaning service package, we use a carpet shampooing machine if carpet cleaning is required.</p><p><br></p><p>However, if you want carpet steam cleaning, please book it separately or discuss it with our friendly team.</p>', NULL, 'Adelaide', 9, '#ffffff', 'Yes', '2022-01-31 20:17:01', '2022-02-11 18:45:02');
INSERT INTO `term_custom_fields` (`id`, `content_term_id`, `content_term_parent_id`, `content_type`, `content_title`, `content_seo_url`, `content_sub_title`, `content_image`, `content_page_banner`, `content_details`, `content_short_details`, `content_zone`, `sorting_order`, `bg_color`, `is_active`, `created_at`, `updated_at`) VALUES
(648, 12, 9, 'Right Image Content Without Title', 'Exterior window cleaning:', 'exterior-window-cleaning', NULL, '129', NULL, '<p><strong>Exterior window cleaning:</strong></p><p>We can’t predict how big the windows are or how many panes are there without visiting the property. We assume a price based on the property details you provided in our system.</p><p><br></p><p>However, the price may vary based on the number of panes, high windows, jobs difficulties, etc. There is a higher chance of damage when we open and re-install fly screens after cleaning.</p><p><br></p><p>That’s why we ask our clients to keep the fly-screens removed before we start and re-install when we finish. Or else, we will avoid those glasses.</p>', NULL, 'Adelaide', 11, '#ffffff', 'Yes', '2022-01-31 20:20:33', '2022-02-11 18:45:02'),
(649, 12, 9, 'Left Image Content Without Title', 'Spot Cleaning from walls:', 'spot-cleaning-from-walls', NULL, '126', NULL, '<p><strong>Spot Cleaning from walls:</strong><br></p><p>Most people think it should be on the general cleaning list, but we know this can be the hardest part of the job. The price we quote over the phone or in our system is just an approximate idea.</p><p><br></p><p>Based on the condition of the walls, we will decide the actual amount after discussing with you when our team is on-site.</p><p><strong><br></strong></p><p><strong>Garage cleaning:</strong></p><p>In garage cleaning, we sweep and vacuum the floor, remove the cobwebs, dust the walls, and clean the skirting boards only.</p>', NULL, 'Adelaide', 12, '#ffffff', 'Yes', '2022-01-31 20:30:15', '2022-02-11 18:45:02'),
(650, 12, 9, 'Right Image Content Without Title', 'Blinds cleaning:', 'blinds-cleaning', NULL, '124', NULL, '<p><strong>Blinds cleaning:\r\n</strong></p><p>There are different types of blinds, and some seem very easy to clean but take too much time that you can’t even imagine. That’s why we charge extra for general blind cleaning. Please note, we don’t clean curtains at all, but you can go to this website for a quote.</p><p><strong><br></strong></p><p><strong>Balcony cleaning:</strong></p><p>We do not scrub the balcony but sweep, vacuum, and mop. Also, clean the outside glasses of the sliding doors when the balcony is considered an extra service.</p>', NULL, 'Adelaide', 13, '#ffffff', 'Yes', '2022-01-31 20:34:40', '2022-02-11 18:45:02'),
(651, 12, 9, 'Left Image Content Without Title', 'Air-conditioner vent cleaning:', 'air-conditioner-vent-cleaning', NULL, '128', NULL, '<p><strong>Air-conditioner vent cleaning:</strong><br></p><p>We can quote for this only when our team is on-site, and they can do it since it can be a critical job. The price depends based on the difficulties and cleaning requirements upon discussion.</p><p><br></p><p><strong>Exterior house cleaning:</strong></p><p>This includes sweeping the outside area, removing cobwebs, and washing the whole house by hose pipe. No pressure washing is included in this service. If you need to remove any oil stains or something like that, please discuss it with our friendly team.<br></p>', NULL, 'Adelaide', 14, '#ffffff', 'Yes', '2022-01-31 20:50:03', '2022-02-11 18:45:02'),
(652, 12, 9, 'Right Image Content', 'Things we don\'t in our regular end of lease cleaning service Adelaide:', 'things-we-dont-in-our-regular-end-of-lease-cleaning-service-adelaide', NULL, '133', NULL, '<p></p><ul><li>Cleaning ceilings or anything more than 3 meters high, for example, windows if was not discussed before.</li><li>Lifting heavy items and furniture to clean underneath or inaccessible areas or corners by hand, mop, or vacuum.</li><li>Cleaning inside appliances if not booked as an extra service like fridge, washing machine, etc.</li></ul><p></p>', NULL, 'Adelaide', 16, '#ffffff', 'Yes', '2022-01-31 21:00:28', '2022-02-11 18:45:02'),
(653, 12, 9, 'Left Image Content', 'End of lease cleaning - bond back guarantee:', 'end-of-lease-cleaning---bond-back-guarantee', NULL, '134', NULL, '<ul><li>Bond back guarantee means we return for free to rectify any issues your agent has from our checklist.</li><li>To claim a guarantee, you need to email us within 7 calendar days with the exit report and the agent\'s details. Any complaint will only be accepted in writing by email with photos.</li><li>In the case of any cleaning complaint, we require either the customer or the property manager to check the work. While our cleaners are still present on the property, please make sure complaints have been fixed to the standard you want.</li><li>With our unstoppable desire to grow the business, we can assure you, for one thing, you will never regret choosing us.</li></ul>', NULL, 'Adelaide', 17, '#ffffff', 'Yes', '2022-02-01 16:22:54', '2022-02-11 18:45:02'),
(654, 12, 9, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 8, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-02-11 19:26:10'),
(655, 12, 9, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 15, '#ffffff', NULL, '2022-02-11 18:42:46', '2022-02-11 19:26:26'),
(656, 13, 9, 'Bullets Vertical', 'Know before booking our end of lease cleaning services:', 'know-before-booking-our-end-of-lease-cleaning-services', NULL, '136', NULL, '<p>For the following service we charge extra in our end of lease cleaning services</p>', 'Please note, we will take before and after photos of the above items for comparison and quality control purposes', 'Adelaide', 18, '#ffffff', 'Yes', '2021-10-21 02:09:49', '2022-02-11 18:45:02'),
(657, 13, 9, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, '8', NULL, NULL, NULL, 'Adelaide', 4, '#ffffff', 'Yes', '2021-10-22 11:06:58', '2022-02-11 19:25:57'),
