(681, 14, 9, 'Left Image Content Without Title', 'Exit Cleaning is an <span>Art</span>', 'exit-cleaning-is-an-spanartspan', NULL, '107', NULL, '<p>To beat the competition, now most cleaning companies provide a 100% bond back guarantee with their bond cleaning services. No doubt everyone\'s finger crosses for no issues after leaving the property.&nbsp;</p><p><strong><br></strong></p><p><strong>However, bad situations come, mistakes happen, and it\'s normal, correct?</strong></p><p>It happens with us as well. We also need to go back sometimes to a job a second time when your agent finds any issues with our cleaning services.</p>', NULL, 'Adelaide', 2, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-02-11 18:45:02'),
