(768, 23, 10, 'Why Choose Us', 'Why choose us', 'why-choose-us', NULL, '50', NULL, '<p>Services we provide</p>', NULL, 'Adelaide', 3, '#f5f5f5', 'Yes', '2022-01-23 10:25:14', '2022-02-11 18:45:02'),
(769, 23, 10, 'Right Image Content', 'Bond Cleaning <span>In Adelaide</span>', 'bond-cleaning-spanin-adelaide', 'We work relentlessly to get your bond back and provide ultimate cleaning.', '103', NULL, '<p>As an end of lease cleaning service provider in Adelaide, we are not the best, but still, our competitors hate us.\r\n\r\nNo, wrong if you think because we charge the least money to provide any end of lease cleaning service.&nbsp;</p><p><br></p><p>We must say we are not the cheapest but affordable than many other competitors in the market.\r\n\r\nOther bond cleanings or exit cleaning service providers hate us because our clients love us.&nbsp;</p><p><br></p><p>They do marketing for us to their friends and families. They advise us about how to make our service better and so on.</p>', NULL, 'Adelaide', 1, '#ffffff', 'Yes', '2022-01-23 20:44:47', '2022-02-11 18:45:02'),
(770, 23, 10, 'Left Image Content', 'Bond back guaranteed', 'bond-back-guaranteed', NULL, '108', NULL, '<p>Our thorough cleaning will ensure that the property is good enough for you to get 100% bond money back as a tenant.</p><p><br></p><p>Agents and landlords to the other side will have no problem getting new bonds with a clean property.<br></p><p><br></p><p>We have a full range of cleaning equipment and experienced teams to carry out a comprehensive end-of-lease cleaning for you. We have options to choose from our tailored packages or customize one that suits your needs.</p>', NULL, 'Adelaide', 6, '#000000', 'Yes', '2022-01-23 21:01:21', '2022-02-11 18:45:02'),
(771, 23, 10, 'Left Image Content Without Title', 'Exit Cleaning is an <span>Art</span>', 'exit-cleaning-is-an-spanartspan', NULL, '107', NULL, '<p>To beat the competition, now most cleaning companies provide a 100% bond back guarantee with their bond cleaning services. No doubt everyone\'s finger crosses for no issues after leaving the property.&nbsp;</p><p><strong><br></strong></p><p><strong>However, bad situations come, mistakes happen, and it\'s normal, correct?</strong></p><p>It happens with us as well. We also need to go back sometimes to a job a second time when your agent finds any issues with our cleaning services.</p>', NULL, 'Adelaide', 2, '#e8e8e8', 'Yes', '2022-01-24 14:05:45', '2022-02-11 18:45:02'),
