(827, 18, 10, 'Right Image Content', 'To provide the following service we charge extra in our end of lease cleaning service Adelaide:', 'to-provide-the-following-service-we-charge-extra-in-our-end-of-lease-cleaning-service-adelaide', NULL, '127', NULL, '<p><strong>Carpet steam cleaning:</strong></p><p>It is considered an extra service since every property doesn’t have carpets. In our regular end of lease cleaning service package, we use a carpet shampooing machine if carpet cleaning is required.</p><p><br></p><p>However, if you want carpet steam cleaning, please book it separately or discuss it with our friendly team.</p>', NULL, 'Adelaide', 9, '#ffffff', 'Yes', '2022-01-31 20:17:01', '2022-02-11 18:45:02'),
(828, 18, 10, 'Right Image Content Without Title', 'Exterior window cleaning:', 'exterior-window-cleaning', NULL, '129', NULL, '<p><strong>Exterior window cleaning:</strong></p><p>We can’t predict how big the windows are or how many panes are there without visiting the property. We assume a price based on the property details you provided in our system.</p><p><br></p><p>However, the price may vary based on the number of panes, high windows, jobs difficulties, etc. There is a higher chance of damage when we open and re-install fly screens after cleaning.</p><p><br></p><p>That’s why we ask our clients to keep the fly-screens removed before we start and re-install when we finish. Or else, we will avoid those glasses.</p>', NULL, 'Adelaide', 11, '#ffffff', 'Yes', '2022-01-31 20:20:33', '2022-02-11 18:45:02'),
(829, 18, 10, 'Left Image Content Without Title', 'Spot Cleaning from walls:', 'spot-cleaning-from-walls', NULL, '126', NULL, '<p><strong>Spot Cleaning from walls:</strong><br></p><p>Most people think it should be on the general cleaning list, but we know this can be the hardest part of the job. The price we quote over the phone or in our system is just an approximate idea.</p><p><br></p><p>Based on the condition of the walls, we will decide the actual amount after discussing with you when our team is on-site.</p><p><strong><br></strong></p><p><strong>Garage cleaning:</strong></p><p>In garage cleaning, we sweep and vacuum the floor, remove the cobwebs, dust the walls, and clean the skirting boards only.</p>', NULL, 'Adelaide', 12, '#ffffff', 'Yes', '2022-01-31 20:30:15', '2022-02-11 18:45:02'),
(830, 18, 10, 'Right Image Content Without Title', 'Blinds cleaning:', 'blinds-cleaning', NULL, '124', NULL, '<p><strong>Blinds cleaning:\r\n</strong></p><p>There are different types of blinds, and some seem very easy to clean but take too much time that you can’t even imagine. That’s why we charge extra for general blind cleaning. Please note, we don’t clean curtains at all, but you can go to this website for a quote.</p><p><strong><br></strong></p><p><strong>Balcony cleaning:</strong></p><p>We do not scrub the balcony but sweep, vacuum, and mop. Also, clean the outside glasses of the sliding doors when the balcony is considered an extra service.</p>', NULL, 'Adelaide', 13, '#ffffff', 'Yes', '2022-01-31 20:34:40', '2022-02-11 18:45:02'),
(831, 18, 10, 'Left Image Content Without Title', 'Air-conditioner vent cleaning:', 'air-conditioner-vent-cleaning', NULL, '128', NULL, '<p><strong>Air-conditioner vent cleaning:</strong><br></p><p>We can quote for this only when our team is on-site, and they can do it since it can be a critical job. The price depends based on the difficulties and cleaning requirements upon discussion.</p><p><br></p><p><strong>Exterior house cleaning:</strong></p><p>This includes sweeping the outside area, removing cobwebs, and washing the whole house by hose pipe. No pressure washing is included in this service. If you need to remove any oil stains or something like that, please discuss it with our friendly team.<br></p>', NULL, 'Adelaide', 14, '#ffffff', 'Yes', '2022-01-31 20:50:03', '2022-02-11 18:45:02'),
(832, 18, 10, 'Right Image Content', 'Things we don\'t in our regular end of lease cleaning service Adelaide:', 'things-we-dont-in-our-regular-end-of-lease-cleaning-service-adelaide', NULL, '133', NULL, '<p></p><ul><li>Cleaning ceilings or anything more than 3 meters high, for example, windows if was not discussed before.</li><li>Lifting heavy items and furniture to clean underneath or inaccessible areas or corners by hand, mop, or vacuum.</li><li>Cleaning inside appliances if not booked as an extra service like fridge, washing machine, etc.</li></ul><p></p>', NULL, 'Adelaide', 16, '#ffffff', 'Yes', '2022-01-31 21:00:28', '2022-02-11 18:45:02'),
(833, 18, 10, 'Left Image Content', 'End of lease cleaning - bond back guarantee:', 'end-of-lease-cleaning---bond-back-guarantee', NULL, '134', NULL, '<ul><li>Bond back guarantee means we return for free to rectify any issues your agent has from our checklist.</li><li>To claim a guarantee, you need to email us within 7 calendar days with the exit report and the agent\'s details. Any complaint will only be accepted in writing by email with photos.</li><li>In the case of any cleaning complaint, we require either the customer or the property manager to check the work. While our cleaners are still present on the property, please make sure complaints have been fixed to the standard you want.</li><li>With our unstoppable desire to grow the business, we can assure you, for one thing, you will never regret choosing us.</li></ul>', NULL, 'Adelaide', 17, '#ffffff', 'Yes', '2022-02-01 16:22:54', '2022-02-11 18:45:02'),
(834, 18, 10, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 8, '#ffffff', NULL, '2022-02-11 18:40:20', '2022-02-11 19:26:10'),
(835, 18, 10, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 15, '#ffffff', NULL, '2022-02-11 18:42:46', '2022-02-11 19:26:26'),
(837, 55, 7, 'Right Image Content Without Title', 'Prepare your home before hiring a tile and grout cleaner', 'prepare-your-home-before-hiring-a-tile-and-grout-cleaner', NULL, '331', NULL, '<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\">It\r\n works but cannot give a sparkling result as a tile and grout cleaning \r\nmachine does. Also, this process can leave a big mess on your carpet and\r\n other floor areas.<br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\">Then\r\n you may have to call the carpet steam cleaner to clean the carpet \r\nagain. As per our experience, you should always go for the option with a\r\n machine.<br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><br></p><p>Our\r\n team at Oz Cleaners never goes for the manual method since we have \r\nmodern equipment to do your job and provide you with a shiny floor.</p><h4>Prepare your home before hiring a tile and grout cleaner</h4><p><br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\">&nbsp;We divided the preparation for stone, tile, or grout cleaning into six easy steps. Follow these steps below to ensure your house is ready for the tile and grout cleaning service.<br>&nbsp;<br><strong>Step 1:</strong> Remove any clutter that blocks your tiles and grout. Our team will perform better with fewer items blocking the desired cleaning area.<br>We do not want clutter to get in the way, whether in the kitchen, bathroom, or entryway.<br>Not only that, but these items can be tripping hazards, and we would like to ensure our cleaning professionals and you stay safe.<br>&nbsp;<br><strong>Step 2:</strong> Remove any rugs, mats, and other floor coverings. Set any floor coverings aside so that our technicians have clear access to the floor.<br>It allows complete concentration to apply the deep cleaning process to every part of stone and grout, providing a healthy shine.<br>&nbsp;<br><strong>Step 3</strong>: Move furniture out of the way. If you have kitchen tables, chairs, barstools over the area being cleaned, move these out of the way to a safe location.<br>After the tile is cleaned and dry, you may move the furniture back and arrange it as you like.<br><br></p>', NULL, 'Adelaide', 3, '#ffffff', NULL, '2022-05-12 08:19:07', '2022-05-16 13:29:56'),
(838, 55, 7, 'Left Image Content', 'Sweep the area', 'sweep-the-area', NULL, '289', NULL, '<p><strong>Step 4:</strong> Sweep the area. It does not need to be anything more than a quick sweep to remove dust, loose dirt, and pieces of food.<br>It will simplify the process and have a lower likelihood of the particles getting stuck to the ground once they are wet.<br>&nbsp;<br><strong>Step 5:</strong> Provide a clear path. Our technician will need ready access to transport the equipment from the van to the area needing to clean.<br>Please provide a safe, clear path for the cleaning process.<br>&nbsp;</p>', NULL, 'Adelaide', 4, '#ffffff', NULL, '2022-05-12 08:31:52', '2022-05-15 08:08:13'),
(841, 55, 7, 'Left Image Content', 'Things we do not do as standard in tile and grout cleaning:', 'things-we-do-not-do-as-standard-in-tile-and-grout-cleaning', NULL, '349', NULL, '<ul><li>Lifting heavy items and furniture to clean the underneath&nbsp; &nbsp;</li><li>Areas not accessible - such as under the fridge or bed</li><li>Cannot remove the stain from heavy use on the tile</li><li>Some grout absorbs the dart if there was no sealing before and we cannot clean this very well.</li></ul>', NULL, 'Adelaide', 11, '#ffffff', NULL, '2022-05-12 12:13:44', '2022-05-17 13:18:59'),
(842, 72, 7, 'Left Image Content', 'Oven and BBQ cleaning - satisfaction guarantee', 'oven-and-bbq-cleaning---satisfaction-guarantee', NULL, '218', NULL, '<ul><li>Our guarantee means we will return free of charge to rectify any issues the agent (for end-of-lease cleaning) or you have with our window cleaning service. To claim a guarantee, you need to email us within 7 calendar days with the exit report and the agent\'s details. Any complaint will only be accepted in writing by email with photos.</li><li>No exceptions to the 7 calendar days condition unless discussed in writing by email before the job is done. It may take up to 3 working days to rectify the issues raised by your agent.</li><li>In the case of any cleaning complaint, we require either the customer or the property manager to check the work. While our cleaners are still present on the property, please make sure complaints have been fixed to the standard you want.</li></ul><p>With our unstoppable desire to grow the business, we can assure you, for one thing, that you will never regret choosing us.<br></p>', NULL, 'Adelaide', 10, '#ffffff', NULL, '2022-05-13 12:09:25', '2022-05-13 12:12:37'),
(843, 55, 7, 'Left Image Content Without Title', 'Prepare your pets.', 'prepare-your-pets', NULL, '292', NULL, '<p><strong>Step 6:</strong> Prepare your pets. A new person in your \r\nhouse, particularly someone bringing new equipment and new smells, can \r\npotentially irritate your pets.<br>So please make sure that you have prepared for this. Have a plan ready where you will keep any pets during the cleaning?<br>&nbsp;<br>If\r\n you can follow the above steps before hiring our team, then Oz Cleaners\r\n can assure the best value of your money buying our service.<br>We are a top company providing tiles and grouting cleaning services to the residence of Adelaide in recent years. <br>&nbsp;Oz\r\n Cleaners carries out full-spectrum cleaning services with specialized \r\ncare. With more than a decade of combined experience, we are fully \r\nupdated with the latest cleaning equipment and agents.<br></p><p><br></p><p><strong>These can give the best results while being environment-friendly too.</strong></p>', NULL, 'Adelaide', 5, '#ffffff', NULL, '2022-05-15 08:07:44', '2022-05-15 08:37:19'),
(844, 39, 7, 'Right Image Content Without Title', 'Grow our business in the cleaning', 'grow-our-business-in-the-cleaning', NULL, NULL, NULL, '<p>We have an unstoppable desire to grow our business in the cleaning industry in Adelaide, South Australia. So we assure you will never regret it if you buy our services for your regular house cleaning service among many other competitors out there.<br><br>&nbsp;It’s like a guarantee from us that there is a very high chance of regretting after taking other cheap services for your regular house cleaning.<br><br>&nbsp;<br></p>', NULL, 'Adelaide', 15, '#ffffff', NULL, '2022-05-15 12:12:13', '2022-05-16 09:54:11'),
(845, 39, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 16, '#ffffff', NULL, '2022-05-15 12:31:51', '2022-05-16 09:54:11'),
(846, 39, 7, 'Right Image Content Without Title', 'choose oz cleaner', 'choose-oz-cleaner', NULL, '312', NULL, '<p>You’ve worked hard all week and life is busy. We get it, which is why \r\nwe’re here to help! It’s time to give yourself permission to reclaim a \r\nbit of ‘you’ time and get your weekends back. Buying a regular house \r\ncleaning service from Oz Cleaners has been made easy and affordable with\r\n several services available to suit your needs.</p><h4><br></h4><h4>How to choose the best house cleaning service provider?<br></h4><p>You don\'t want to let just anyone into your home, especially if you\'re \r\nnot there to supervise the work. Only hire reputable house cleaning \r\nservices that carry insurance and can offer customer testimonials or \r\nallow you to contact clients in person. Better services will do \r\nbackground checks on their employees to be sure they are trustworthy and\r\n any reputable company like Oz Cleaners will guarantee their work.</p>', NULL, 'Adelaide', 3, '#ffffff', NULL, '2022-05-16 09:53:42', '2022-05-17 13:26:30'),
(847, 38, 7, 'Left Image Content', 'Spring cleaning - satisfaction guarantee:', 'spring-cleaning---satisfaction-guarantee', NULL, '338', NULL, '<ul><li>Our guarantee means we will return free of charge to rectify any issues the agent (for end-of-lease cleaning) or you have with our window cleaning service.</li><li>To claim a guarantee, you need to email us within 7 calendar days with the exit report and the agent\'s details. Any complaint will only be accepted in writing by email with photos.</li><li>No exceptions to the 7 calendar days condition unless discussed in writing by email before the job is done. It may take up to 3 working days to rectify the issues raised by your agent.</li><li>In the case of any cleaning complaint, we require either the customer or the property manager to check the work. While our cleaners are still present on the property, please make sure complaints have been fixed to the standard you want.</li></ul><p><br>With our unstoppable desire to grow the business, we can assure you, for one thing, that you will never regret choosing us.<br></p>', NULL, 'Adelaide', 15, '#ffffff', NULL, '2022-05-16 17:35:34', '2022-05-17 12:24:44'),
(848, 38, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 16, '#ffffff', NULL, '2022-05-16 17:37:20', '2022-05-16 17:37:33'),
(849, 57, 7, 'Right Image Content Without Title', 'home can be cleaned in two ways', 'home-can-be-cleaned-in-two-ways', NULL, '389', NULL, '<p>Surfaces on and around your home can be cleaned in two ways: soft washing and pressure washing.</p><p>Both\r\n mild and high-pressure washing is included in power cleaning. Pressure \r\nwashing is harsher on surfaces than soft cleaning. It can eliminate \r\nimpurities that are firmly buried, making it ideal for hard and \r\npermeable surfaces like concrete. Soft washing employs less pressure, \r\nwhich affects cleaning effectiveness while making cleaning softer \r\nsurfaces easier.</p><p>Thankfully, most pressure washers include \r\nadjustable pressure settings. You can choose between a high or \r\nlow-pressure wash with each machine. Both pressure cleaning and gentle \r\nwashing have benefits and drawbacks.</p>', NULL, 'Adelaide', 3, '#ffffff', NULL, '2022-05-18 12:05:17', '2022-05-24 17:04:05'),
(850, 73, 7, 'Right Image Content', 'What chemicals do we use to soft wash a house?', 'what-chemicals-do-we-use-to-soft-wash-a-house', NULL, '473', NULL, '<p>The main cleaning agent utilized by our professionals for gentle washing roofs and siding is a professional-grade 12.5 percent sodium hypochlorite, or bleach, combined with water.<br>Sodium hypochlorite (bleach) and a foaming or surfactant agent are usually included in the cleaning solution for residential soft house washing. Bleach or sodium hypochlorite, when applied appropriately, is incredibly effective and safe. It\'s the same chemical that\'s used to treat or disinfect swimming pools and drinking water.<br>When used with bleach, the foaming or surfactant ingredient can dissolve algae, mold, and mildew. Spider webs, dust, debris, and filth are suspended in the foamy combination, which is readily removed with a low-pressure jet of water.<br></p>', NULL, 'Adelaide', 18, '#ffffff', NULL, '2022-05-22 16:48:42', '2022-05-23 12:28:29'),
(851, 73, 7, 'Right Image Content Without Title', 'What are the benefits of our soft washing service?', 'what-are-the-benefits-of-our-soft-washing-service', NULL, '462', NULL, '<p>• Soft siding materials such as cedar shake siding, wood panel siding, and other soft siding materials.<br>• To remove mold, algae, mildew, dirt, and other surface pollutants from concrete that is less than three years old without affecting the surface below.<br>• To clean outdoor wood furniture, rooted plants, screens, and enclosures.<br>• To clean any conventional surface, such as a roof or a deck, if you don\'t want to compromise the structural integrity of that surface.<br></p>', NULL, 'Adelaide', 6, '#ffffff', NULL, '2022-05-22 16:53:48', '2022-05-23 11:54:10'),
(852, 73, 7, 'Left Image Content', 'Commonly Asked Questions Regarding Soft vs. Pressure Washing', 'commonly-asked-questions-regarding-soft-vs-pressure-washing', NULL, '454', NULL, '<p>For years, homeowners have debated which approach is ideal for cleaning their home\'s exterior.<br>Many people have probably bought or rented a pressure washer once or twice and discovered that while it can get the job done, it does not last. Ask yourself the following questions to determine which option is genuinely the best:<br><br><strong>Can I use a pressure washer to do a soft wash?</strong><br>Yes! Your pressure washer\'s PSI (pounds per square inch) is likely adjustable. You can soft wash just fine if you can bring the dial down to below 500 PSI. Some nozzles can also aid to relieve hose pressure.<br><br><br></p>', NULL, 'Adelaide', 2, '#ffffff', NULL, '2022-05-22 16:57:19', '2022-05-23 11:30:33'),
(853, 73, 7, 'Left Image Content', 'House Soft Washing-Satisfaction Guarantee', 'house-soft-washing-satisfaction-guarantee', NULL, NULL, NULL, '<h4 class=\"term_page_heading\"><br></h4>\r\n                    <h6 class=\"term_page_sub_heading\"></h6>Customer satisfaction is our objective, and we \r\nstrive to go above and above every time. It motivates our professionals \r\nand businesses to provide high-quality services.<p><br></p><ul><li>If\r\n you are not completely pleased with the results, we will redo the task.\r\n If you are still displeased with the work, you do not have to pay for \r\nit.</li><li>To claim a guarantee, you need to email us within 7 calendar days with \r\nthe exit report and the agent\'s details. Any complaint will only be \r\naccepted in writing by email with photos.</li><li>In the case of any cleaning complaint, we require either the customer or\r\n the property manager to check the work. While our cleaners are still \r\npresent on the property, please make sure complaints have been fixed to \r\nthe standard you want.</li></ul><p><br></p><p>We want to keep you as a long-term customer, therefore we\'re committed to giving you the finest possible service!</p>', NULL, 'Adelaide', 19, '#ffffff', NULL, '2022-05-23 05:35:24', '2022-05-23 10:47:36'),
(854, 73, 7, 'Right Image Content Without Title', 'asked question', 'asked-question', NULL, '458', NULL, '<p><strong>Is soft washing safe?</strong><br>Absolutely! Soft \r\nwashing employs gentle cleaning chemicals that are similar to soap and \r\nwater to clean your home softly. Soft washing can help protect any paint\r\n or stains on your house\'s siding and extend its life. Soft washing is \r\nalso safe to use on screens, wood paneling, and shingles, which would \r\notherwise be harmed by pressure washing.<br><strong><br></strong></p><p><strong>When should a house be gently washed?</strong><br>You\r\n can undertake gentle washing whenever you feel your house is dirty \r\nbecause it is safer and less destructive than pressure washing. However,\r\n every 2 to 3 years is a decent rule of thumb.<br><strong><br></strong></p><p><strong>Can I soft wash a roof?</strong><br>Sure! Soft washing is, in fact, the most effective method for cleaning your roof.<br>The\r\n decreased pressure reduces the likelihood of water entering inside your\r\n property by blowing up beneath the roofs or gutters. In addition, \r\nshingles are likely to have some debris and dirt on them, and a mild \r\nwash can clean them as well as eliminate germs and mold that can damage \r\nyour shingles over time.</p>', NULL, 'Adelaide', 3, '#ffffff', NULL, '2022-05-23 05:42:29', '2022-05-23 11:40:49'),
(856, 73, 7, 'Special Text', 'To get a customized quote for you - fill the form, call us or chat with us', 'to-get-a-customized-quote-for-you---fill-the-form-call-us-or-chat-with-us', NULL, NULL, NULL, NULL, NULL, 'Adelaide', 20, '#ffffff', NULL, '2022-05-23 10:47:03', '2022-05-23 10:47:36');
