(7, 'Normal List', 34, 5, 'None', 'None', '8', NULL, '<p>Our team does their best to make the cleaning spotless but not guaranteed since some marks are permanent or very hard to remove, and trying too hard may cause damages, so we leave those.</p>', NULL, 'Adelaide', NULL, '2021-10-21 02:10:12', '2022-02-06 18:49:39'),
(8, 'Normal List', 34, 5, 'none', 'none', '8', NULL, '<p>The customer is to provide access to the property when the service is due to be performed. If not available at the appointed time, then responsible for providing us access to the keys. Failure to do so is subject to a cancellation/postponement/late fee as per our terms and conditions.</p>', NULL, 'Adelaide', NULL, '2021-10-21 02:10:27', '2022-02-06 18:50:53'),
(9, 'Normal List', 34, 5, 'none', 'none', '16', NULL, '<p>Running hot water and electricity must be available within the property. Failure to provide these is subject to a cancellation/postponement fee or extra charge to use the generator as per our terms and conditions.<br></p>', NULL, 'Adelaide', NULL, '2021-10-21 02:10:40', '2022-02-06 18:51:17'),
(10, 'Normal List', 34, 8, 'Kitchen', NULL, '112', NULL, '<p><ul><li>Oven inside &amp; out</li><li>Stovetop &amp; range hood</li><li>Backsplash &amp; bench top</li><li>Cupboard\'s inside &amp; out</li><li>Dishwasher inside &amp; out</li><li>Wipe appliance’s exterior</li><li>Clean windows &amp; sills</li><li>Polish taps &amp; sinks</li><li>Floor vacuum &amp; mop</li></ul></p>', NULL, 'Adelaide', 0, '2021-10-22 11:08:48', '2022-02-06 19:08:55'),
(11, 'Normal List', 34, 8, 'All Rooms', NULL, '111', NULL, '<p><ul><li>Remove all internal cobwebs</li><li>Wipe cabinet\'s inside &amp; out</li><li>Clean all mirrors &amp; tracks</li><li>Clean doors &amp; door frames</li><li>Dust &amp; wipe all skirting boards</li><li>Light fittings &amp; switchboards</li><li>Clean internal windows &amp; sills</li><li>Dust all accessible surfaces</li><li>Floors vacuum &amp; mop</li></ul></p>', NULL, 'Adelaide', 2, '2021-10-22 11:09:58', '2022-02-06 19:08:55'),
(12, 'Normal List', 34, 8, 'Bathroom & Laundry', NULL, '109', NULL, '<p><ul><li>Wipe appliance’s exterior</li><li>Clean exhaust fans</li><li>Clean &amp; wipe toilet</li><li>Clean basin &amp; mirror</li><li>Clean vanity drawers</li><li>Clean shower screen</li><li>Clean &amp; wipe bathtub</li><li>Polish taps &amp; sinks</li><li>Floor vacuum &amp; mop</li></ul></p>', NULL, 'Adelaide', 1, '2021-10-22 11:10:14', '2022-02-06 19:08:55'),
(24, 'Normal List', 34, 26, 'Reasonable Price', 'Reasonable Price', NULL, 'fas fa-hands-usd', '<p>Unlike others, along with our quality, we are very reasonable &amp; affordable.</p>', NULL, 'Adelaide', 0, '2022-01-23 10:45:02', '2022-02-09 17:37:13'),
(25, 'Normal List', 34, 26, 'Satisfaction Guarenteed', 'Satisfaction Guarenteed', NULL, 'fas fa-thumbs-up', '<p>Bad thing happens on the job; we always admit it and stay on your side.</p>', NULL, 'Adelaide', 1, '2022-01-23 10:47:49', '2022-02-09 17:39:19'),
(26, 'Normal List', 34, 26, 'Quality Staffs', 'Quality Staffs', NULL, 'fa fa-users', '<p>We never let anyone inexperienced work for our clients &amp; that\'s a promise.</p>', NULL, 'Adelaide', 2, '2022-01-23 10:48:43', '2022-01-30 19:53:01'),
